insert  into `lokasi_obat`(`id_lokasi`,`id_admin`,`nama`,`latitude`,`longitude`,`tempat`,`foto`,`deskripsi`,`open_timeinfo`) values (61,1,'Rumah Sakit Dharmais',-6.187313899999999,106.798522,NULL,'1477021313682-rs_dharmais.jpg','<p><span style=\"color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\">Prof. Dr. dr. Samsuridjal Djauzi, SpPD-KAI menjelaskan tentang tes dan pengobatan HIV di Jakarta. Di Indonesia ada sekitar 250 tempat testing dan pengobatan HIV, dan di Jakarta ada lebih dari 25 tempat, dan yang terbesar antara lain di RS Ciptomangunkusumo dan Dharmais. Untuk pengetesan di RSCM dan Dharmais, pasien membayar 120.000 rupiah untuk menjalani 4 macam pemeriksaan; 3 untuk antibodi, dan 1 untuk antigen B 24. Apabila hasil tes negatif, pasien tetap harus menjaga kesehatan dengan cara memakai kondom dan menghindari penggunaan jarum bersama. Apabila hasil tes positif, pasien akan diobati dengan ARV, yang diberikan sesuai dengan rekomendasi WHO. Yang paling penting dalam pengobatan adalah kepatuhan, ketepatan waktu, kesesuaian dosis, dan jangan sampai lupa. Dr Syamsuridjal juga menjelaskan tentang biaya dan waktu pelayanan di Rumah Sakit Dharmais. Biaya tiket dan dokter di RS Dharmais 125.00 rupiah, 25 .000 rupiah lebih mahal daripada di RSCM. Sedangkan waktu pelayanannya adalah sore hari pukul 04.00-07.00 pada hari kerja, dan pukul 09.00-12.00 pada hari sabtu. Rumah Sakit Dharmais dan RSCM juga melayani ARV untuk rumah sakit-rumah sakit lain di Jakarta.</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"><br></span></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\">Rumah Sakit Dharmais </strong></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\">Poliklinik Khusus HIV/AIDS </strong></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Jl. Letjen S. Parman Kav. 84-86, Slipi, Jakarta Barat </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Telp : (021) 5681570 </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Email : dharmais@dharmais.co.id </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Contact Person : Prof. Dr. Samsuridjal (Ketua Tim HIV/AIDS), Mbak Yanti (Konselor) </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Layanan : VCT, MK, ART </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Senin - Jumat : 09.00 - 12.00 WIB</div>','09:00 - 12:00'),(71,1,'Rumah Sakit Umum Pusat Nasional Cipto Mangunkusumo',-6.196071099999999,106.8482317,NULL,'1477022380268-rs_ciptomangunkusumo.jpg','<p><span style=\"color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\">RSCM salah satu klinik yang memberikan layanan HIV sejak lama. Tes yang dilakukan di RSCM adalah rahasia dan akurat. Screening dilakukan melalui 3 macam tes; 2 tes rapid dan 1 tes elisa. </span><br style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"></p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Pelajari bagaimana dr. Darma menjelaskan kepada TemanTeman langkah mudah dan sederhana untuk menjalani tes di RSCM. TemanTeman bisa mendapatkan tes dengan surat rujukan dari dokter lain, atau datang sendiri secara sukarela ke Klinik RSCM. Tes Sukarela diawali dengan pretes konseling, lalu dilakukan tes, dan setelah hasilnya diketahui, dilakukan post tes konseling. Dengan post tes konseling, hasil tes diberikan kepada pasien untuk kemudian dilakukan tindak lanjut.</p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102); display: inline !important;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Pokdisus AIDS FKUI , </div><p><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"> </strong></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102); display: inline !important;\">Rumah Sakit Cipto Mangunkusumo </div><p><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"> </strong></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102); display: inline !important;\"> </div><p><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"> </strong><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\">Unit Pelayanan Terpadu HIV Gedung Unit Rawat Jalan Terpadu <br style=\"margin: 0px; padding: 0px;\">Lantai 4, RSCM, Jakarta <br style=\"margin: 0px; padding: 0px;\"></strong></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102); display: inline !important;\">Jl. Diponegoro No. 71, Jakarta Pusat </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Telp/Fax : (021) 3905250 </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102); display: inline !important;\">Layanan : </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">- VCT </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Senin - Jumat : 09.00 - 11.00 WIB </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Pengambilan obat untuk resep yang sudah ada dilakukan setiap hari (Senin-Minggu)</div><p><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"></strong><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"></strong><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"></strong><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Interstate-Regular, helvetica, serif; font-size: 14px;\"></strong></p><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"> <br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">Contact Person ; Ekki, Iin, Tini (021) 3162788, 3141160, 3904546, Layanan SMS ; 087889223345</div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\">HIV/AIDS Counseling ang Testing Hotline : 3162788 / 3905250</strong><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\"><br></strong></div><h2 style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\">Prosedure Tes HIV di Klinik Pokdisus, Rumah Sakit Cipto Mangunkusumo</strong></h2><div><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\"><br></strong></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\"><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\">Dr. Evy menjelaskan bahwa untuk tes HIV pasien bisa pergi ke beberapa tempat, termasuk ke Klinik Pokdisus,  atau Unit Pelayanan Terpadu HIV, di lantai 4 RSCM. Prosedurnya, pertama pasien bertemu konselor untuk pretes konseling, lalu diambil darah sekitar 3-5 cc untuk dites. Setelah hasilnya diberikan, diadakan post tes konseling.  </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\"> </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\">Apabila TemanTeman melakukan tes untuk pertama kali dan hasilnya negatif, maka sebaiknya dilakukan tes lagi selama masa jendela, tiga bulan setelah terakhir kali melakukan tindakan berisiko yang tidak terproteksi, untuk memastikan status HIV-nya. </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\"> </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\">Jika hasil tesnya positif, maka diadakan pemeriksaan untuk mencari infeksi oportunistik dan tingkat stadium atau CD4. Apabila ada infeksi oportunistik, maka infeksi tersebut diobati terlebih dahulu, dan 1-2 bulan kemudian, apabila CD4 350 atau kurang, maka pengobatan ARV dimulai.  </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\"> </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\">Kerahasiaan hasil tes di Pokdisus, Rumah Sakit RSCM dijaga, sehingga hanya pasien dan petugas konselor yang mengetahui identitas pasien.<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"> </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: normal;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\">Unit Pelayanan Terpadu HIV RSUPNCM</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Unit Pelayanan Terpadu HIV RSUPN Cipto Mangunkusumo atau dahulu dikenal sebagai Pokdisus (Kelompok Studi Khusus) AIDS, merupakan salah satu unit kerja fungsional dalam organisasi RSCM. Unit ini berperan sebagai penyelenggara kegiatan pelayanan, penyuluhan, dan penelitian bidang HIV-AIDS. Hal ini dilakukan agfar peran itu dapat berjalan tertib, lancar, dan sesuai dengan ketentuan pertaturan yang telah ditetapkan. UPT berada di bawah dan bertanggung jawab kepada Direktur Medik dan Keperawatan.</div></strong></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"> </div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\">e-mail ; pokdisusaids@gmail.com, alergi@centrin.net.id</div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px;\">Pelayanan Obat ARV</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Hari Kerja      <br style=\"margin: 0px; padding: 0px;\">Pukul 08.00 - 15.30 WIB<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Hari Sabtu dan Minggu <br style=\"margin: 0px; padding: 0px;\">Pukul 09.00 - 15.00 WIB</div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: Interstate-Regular, helvetica, serif; font-size: 14px; color: rgb(102, 102, 102);\"><br></div></div>','09:00 - 11:00'),(111,1,'Rumah Sakit Boromeus',-6.895284200000001,107.6129997,NULL,'1478368547901-boromeus.jpg','<p><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"># Bagian Pastoral Care</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Jl. Juanda No. 100, Bandung</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Telp : (022) 2552014</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Fax : (022) 2504235</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Contact Person : Bpk. Punto</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Layanan : VCT, ART</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Senin – Jumat : 08.00 – 14.00 WIB</span><br style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\"><span style=\"color: rgb(102, 102, 102); font-family: \"Lucida Grande\", Arial, \"Lucida Sans Unicode\", sans-serif;\">Sabtu : 08.00 – 12.30 WIB</span><br></p>','08:00 - 14:00'),(141,1,'Klinik Teratai RSUP Dr. Hasan Sadikin',-6.900166199999999,107.5990495,NULL,'1478370466062-123614_klinikteratai.jpg','<p>Buka senin - jumat.</p><p>Kota Bandung sebagai kota terbanyak kasus AIDS di Jawa Barat merupakan kota tempat RSHS berada. Hal itulah yang menjadi dorongan kuat bagi Tim Penanggulangan HIV/AIDS di Klinik Teratai RSHS untuk melakukan berbagai upaya dalam mencegah penularan HIV/AIDS. Bagaimana tidak, jumlah kasus infeksi HIV/AIDS di klinik teratai tercatat hingga 3352 kasus (data Klinik Teratai tahun 1996 sampai dengan November 2012). Pada awalnya kedatangan pasien baru ke klinik teratai perbulannya sekitar 30 orang, namun kini berkurang hingga sekitar 10-20 orang perbulan.</p><p>RSHS dengan Klinik Teratai-nya telah lama berkiprah menanggulangi HIV/AIDS. Tidak hanya mengobati, Klinik Teratai melakukan upaya-upaya preventif (pencegahan) agar HIV/AIDS tidak menyebar luas. Kegiatan yang dilakukan di klinik yang dipimpin dr. Nirmala Kesuma, MHA ini diantaranya konseling, pengobatan, dan penelitian.</p><p>Alamat : </p><p>Jalan Pasteur No.38, Pasteur, Sukajadi, Kota Bandung, Jawa Barat 40161</p>','08:00 - 14:00'),(161,1,'PKBI Jawa Barat',-6.945860000000001,107.639131,NULL,'1478919714582-pkbi.jpg','<p>Alamat : Jl. Soekarno Hatta No. 496, Sekelimus, Jawa Barat 40266</p><p>Contact : </p><p>+62 22 756 7997 </p><p>+62 22 751 4332</p><p>Fax. +62 22 751 4332</p><p>E-mail.<br></p><p style=\"outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial;