,-6.909897,107.6299937,NULL,'1478924692462-700.jpg','<p>Alamat             : Jl. Salam No. 27 Bandung, Jawa Barat</p><p>No. Telepon    : 022 7234610</p><p>Jam Kerja         : 07.30 - 14.30</p>','07:30 - 14:30'),(201,1,'Rumah Sakit Dr. Hasan Sadikin',-6.900166199999999,107.5990495,NULL,'1479114534709-87692845566rshs.jpg','<p class=\"MsoNormal\" style=\"margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: Ubuntu, Arial, Tahoma, sans-serif; vertical-align: baseline; color: rgb(86, 86, 86); text-align: justify; text-indent: 36pt;\">Sebagai Rumah Sakit yang <em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">concern</em> terhadap penanggulangan HIV/AIDS di Indonesia khususnya di Jawa Barat, RSUP dr. Hasan Sadikin membentuk Tim Penanggulangan Infeksi HIV/AIDS RSHS sejak tahun 1992. Saat itu Tim dibentuk karena dirasakan kebutuhan warga atas pelayanan kesehatan yang prima semakin meningkat serta perkembangan penyakit infeksi HIV/AIDS yang semakin banyak sehingga akan dibutuhkan pelayanan yang lebih komprehensif.</p><p class=\"MsoNormal\" style=\"margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: Ubuntu, Arial, Tahoma, sans-serif; vertical-align: baseline; color: rgb(86, 86, 86); text-align: justify; text-indent: 36pt;\">Sebagai ketua pertama Tim ini adalah Prof. Dr. Tony S. Djajakususmah, dr, SpKK dengan wakil ketua Prof. Dr. Rachmat Sumantri, dr, SpPD, Prof. Dr. Tutie W. Sapiie SpKJ, serta beberapa anggota dari Bagian-bagian yang ada di RSHS. Seiring dengan bertambahnya dokter-dokter dan perawat RSHS yang dilatih untuk kegiatan Pencegahan dan Pengobatan HIV/AIDS, maka pada tahun 2004 anggota Tim bertambah, susunan organisasi diperbaiki, dan uraian tugas diperjelas menjadi <em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">“One Stop Clinic”</em> dan dinamai klinik teratai pada Desember 2004.</p><p class=\"MsoNormal\" style=\"margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: Ubuntu, Arial, Tahoma, sans-serif; vertical-align: baseline; color: rgb(86, 86, 86); text-align: justify; text-indent: 36pt;\">Klinik Teratai merupakan tempat pusat kegiatan penanggulangan HIV/AIDS di RSHS yang pada awalnya terletak di belakang ruang Kedokteran Nuklir. Agar proses pelayanan menjadi semakin nyaman, kini Klinik Teratai RSHS bertempat di Fakultas Kedokteran Jl. Eijkman No 38 Bandung.</p>','07:30 - 15:30'),(211,1,'Puskesmas Kecamatan Cengkareng Jakarta Barat',-6.130818000000001,106.729693,NULL,'1479196850306-ceng.png','Alamat                                        : <span style=\"text-align: justify;\">Jl. Raya Kamal Cengkareng, No. 2, Kelurahan Cengkareng Barat, Kecamatan Cengkareng, Jakarta Barat, Kode Pos 11730</span><div><div><br></div><div>No.Telepon dan Faximile        : <span style=\"text-align: justify;\">021 – 54398366 / 021 – 6191756</span><span style=\"text-align: justify;\"><br></span></div></div><div><span style=\"text-align: justify;\"><br></span></div><div>Email                                           : <span style=\"text-align: justify;\">puskesmascengkareng@yahoo.co.id</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div>SMS Center/ Email Saran dan Keluhan    : <span style=\"text-align: justify;\">0895-506791423/mr.puskesmas.cengkareng@gmail.com puskesmascengkareng@hotmail.com</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div>Kepala Puskesmas                         : <span style=\"text-align: justify;\">dr. Maryati Kasiman, MKKK</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div>Facebook                                         : <span style=\"text-align: justify;\">Puskesmas Kecamatan Cengkareng</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div>Jumlah Perawat, Bidan, Apoteker, Analis Kesehatan dan Staf lainnya    : <span style=\"text-align: justify;\">110 Orang</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div>Jam Operasional Pelayanan         : <span style=\"text-align: justify;\">24 Jam </span><span style=\"text-align: justify;\">Laboratorium/Rontgen : Senin – Jumat</span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\">Layanan HIV/AIDS ada pada Lantai 1, tepatnya :</span></div><div><span style=\"text-align: justify;\">Poli mandiri (Jiwa, HIV-AIDS, IMS, PPIA): memberikan pelayanan pada pasien yang mengalami gangguan jiwa, VCT, PPIA, PITC, terapi ARV, dan penanganan pasien yang khusus mengalami penyakit infeksi menular seksual. Kegiatan di poli ini menjadi program unggulan Puskesmas kecamatan Cengkareng</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\">dan lantai 2, tepatnya :</span></div><div><span style=\"text-align: justify;\">Pada Laboratorium Klinik yang melayani pemeriksaan darah rutin, profil lipid, kimia darah, HbsAg, Rapid Test HIV, Urin rutin, dan pemeriksaan Sputum BTA.</span><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"text-align: justify;\"><br></span></div><div><span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 12px; text-align: justify;\"><br></span></div>','07:00 - 07:00');

