insert  into `posting`(`id_posting`,`id_kategori`,`id_admin`,`judul`,`deskripsi`,`isi`,`foto`,`status`,`tgl_posting`,`sumber`) values (91,1,2,'Beri Kesempatan Anak dengan HIV untuk Hidup Normal','Tak cuma orang dewasa yang bisa terkena HIV, anak usia di bawah 14 tahun pun bisa terinfeksi virus','<p style=\"color: rgb(74, 74, 74); font-family: Arial, helvetica, sans-serif; font-size: 16px; line-height: 25.28px;\">Tak cuma orang dewasa yang bisa terkena <a href=\"http://health.liputan6.com/read/2379184/apa-itu-hiv-aids\" title=\"HIV\" style=\"color: rgb(246, 118, 56);\">HIV</a>, anak usia di bawah 14 tahun pun bisa terinfeksi virus yang menyerang daya tahan tubuh ini. Biasanya, anak-anak tak berdosa ini mendapatkan virus dari sang ibu dengan HIV pada saat hamil, persalinan atau menyusui.</p><p style=\"color: rgb(74, 74, 74); font-family: Arial, helvetica, sans-serif; font-size: 16px; line-height: 25.28px;\"><span style=\"line-height: 25.28px;\">Padahal anak-anak dengan HIV yang sudah mengonsumsi obat antiretroviral tak menular. Sudah selayaknya mereka bisa mendapatkan pendidikan dengan layak.</span>Sayangnya pada beberapa kasus, anak-anak ini sering mendapatkan perlakuan tidak menyenangkan dari sekitarnya. Mulai dari dikucilkan di antara teman-teman, orangtua teman-teman hingga tidak bisa sekolah.</p><p style=\"color: rgb(74, 74, 74); font-family: Arial, helvetica, sans-serif; font-size: 16px; line-height: 25.28px;\">\"Yang paling penting berilah ia kesempatan untuk berkembang. Dia tidak menularkan kok. Anak dengan HIV sudah konsumsi antiretroviral tidak akan menularkan ke yang lain asal ia konsumsi secara teratur,\" terang dokter dari Perhimpunan Dokter Peduli AIDS Indonesia, Samsuridjal Djauzi di Kemenkes RI ditulis Selasa (1/12/2015).</p><p style=\"color: rgb(74, 74, 74); font-family: Arial, helvetica, sans-serif; font-size: 16px; line-height: 25.28px;\">Ditambahkan Kasubdit AIDS dan IMS Ditjen P2PL, Kemenkes RI, dokter Siti Nadia konsumsi obat antiretroviral mampu menekan jumlah virus HIV dalam darah. Sehingga virus di dalam tubuhnya tidak menular dan anak tersebut bisa jalani hidup seperti biasa.</p><p style=\"color: rgb(74, 74, 74); font-family: Arial, helvetica, sans-serif; font-size: 16px; line-height: 25.28px;\">\"Ia tetap bisa berprestasi, tetap bisa sekolah, jarang sakit seperti anak normal lainnya jika terus konsumi ARV,\" terang dokter Nadia.</p>','1464017925491-hiv.PNG','1','2016-05-23 15:38:45',NULL),(111,2,2,'Close The Gap : Belajar dari Daerah dalam Penanggulangan HIV/AIDS pada Komunitas LSL','Jangan biarkan ketidaktahuan Anda menjadi penyesalan di masa yang akan datang. Mari kita pelajari HIV/AIDS sejak dini.','<p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Setiap tahunnya di tanggal 1 Desember, seluruh masyarakat dunia mengenal Hari AIDS Sedunia (HAS / World AIDS Day). Cukup beralasanmengapa momen HAS ini menjadi penting, mengingat peningkatan kasus HIV dan AIDS yang cukup menghawatirkan di setiap tahunnya sehingga menjadi isu permasalahan global. Terbukti dalam tujuan&nbsp;<em>Millenium Development Goals</em>&nbsp;2015, pada tujuan keenam disebutkan adanya upaya penurunan penyakit menular HIV/AIDS. Penyakit ini dengan cepat dapat menyebar ke seluruh dunia (pandemik).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Laporan dari Kementrian Kesehatan Republik Indonesia menyebutkan bahwa jumlah kumulatif kasus HIV/AIDS dari awal peneluan kasus pada April 1987 sampai dengan bulan Juni 2014 sudah terdapat 55.623 kasus, dimana laki-laki berjumalah 29.882 dan perempuan sebesar 16.092, sementara sisanya tidak diketahui identitas seksualnya. Berdasarkan faktor risiko, kasus tertinggi ditemukan pada heteroseksual sebesar 34.187, kemudian IDU sebesar 8.451 kasus dan urutan ketiga tertinggi adalah homoseks dan biseksual sebesar 1.298 kasus (Direktorat Jendral P2 &amp; PL Kemenkes RI, 2014). Dalam strategi komunikasi penanggulangan HIV dan AIDS di Indonesia, terdapat 2 target utama yaitu populasi kunci (<em>key population</em>) dan populasi umum. Populasi Kunci terdiri dari : Pengguna Narkoba suntik/ Penasun/IDU, Penjaja Seks Perempuan (PSP), Lelaki Seks dengan Lelaki (LSL) dan waria serta ODHA.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Peningkatan prevalensi HIV pada populasi LSL menjadi peringatan yang perlu mendapatkan perhatian pemerintah. Program penanggulangan AIDS populasi LSL selama ini telah menerapkan berbagai metode untuk merubah perilaku yang berisiko tinggi. Namun prevalensi HIV pada populasi LSL tetap saja naik. Hasil Survey Terpadu Biologi dan Perilaku (STBP) Tahun 2011 dan Tahun 2013 menunjukan adanya peningkatan prevalensi HIV pada populasi LSL. Di Jakarta, Bandung dan Surabaya pada Tahun 2007 dan 2011, terjadi peningkatan prosentasi prevalensi dari 8,1 %, 2,0 dan 5,1% menjadi 17,2%, 10,4% dan 9,8%. Sama halnya pada hasil STBP tahun 2009-2013, di kota besar lainya, yaitu : Yogyakarta dan Tangerang mengalami peningkatan prosentasi prevalensi HIV pada LSL dari 7,9% dan 9,5% menjadi 20,3% dan 18,8%. Hanya Kota makasar yang mengalami penurunan dari 3,0% pada tahun 2009 menjadi 1,6% pada tahun 2013 (Praptorahardjo dkk, 2014).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">LSL adalah suatu kelompok atau sub masyarakat yang paling tersembunyi (<em>hidden</em>) sehingga sulit sekali untuk diidentifikasi. Diantara pria yang aktif berhubungan seksual, sekitar tiga persen diantaraya adalah mereka yang berhubungan intim dengan sejenis yang dikenal dengan istilah LSL. Menurut perkiraan para ahli dan Badan PBB dengan memperhitungkan jumlah penduduk lelaki dewasa, jumlah LSL saat ini diperkirakan lebih dari tiga juta orang. Sedangkan berdasarkan perkiraan tahun 2009, angkanya hanya sekitar 800 ribu, dimana 60 hingga 80 ribu diantaranya berada di Jakarta (Candra, 2011). Sebagai masyarakat yang paling tersembunyi (<em>hidden</em>), LSL sangat sulit terjangkau oleh program pencegahan dan penanggulangan HIV/AIDS. Di sisi lain, perilaku mereka sangat berisiko terhadap penularan HIV/AIDS, misalnya bergonta-ganti pasangan seksual tanpa menggunakan kondom dan pelicin, serta melakukan oral dan anal seks. Artinya bahwa saat ini LSL yang positif HIV didominasi oleh mereka yang masih berusia produktif dan dalam kategori seksual aktif. Hal ini memungkinkan kemudahan dalam proses penularan HIV/AIDS ke orang lain melalui transmisi seksual (hubungan seksual).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Berdasarkan kenyataan yang disebutkan di atas, maka perlu adanya gerakan yang masif dalam pencegahan penularan HIV dan AIDS di kalangan LSL. Setidaknya momen Hari AIDS pada tanggal 1 Desember 2014 yang bertemakan&nbsp;<em><a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">Close the Gap</a></em>, dapat diartikan sebagai perlunya upaya menutup jurang pemisah dalam penanggulangan HIV dan AIDS di kalangan LSL. Mengingat program penanggulangan AIDS pada populasi LSL selama ini telah menerapkan berbagai metode untuk merubah perilaku yang berisiko tinggi. Namun prevalensi HIV pada populasi LSL tetap saja naik.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Mengacu pada SRAN (Strategi dan Rencana Aksi Nasional) terkait penanggulangan HIV dan AIDS di Indonesia, program-program penanggulangan HIV dan AIDS dikelompokkan menjadi 3 kelompok besar yaitu : Pencegahan, Pengobatan dan Perawatan, serta Mitigasi dampak. Dimana untuk pencegahan dilakukan dengan PMTS, Harm Reduction, serta PMTCT (PPIA). Kegiatan pokok pencegahan penularan HIV memalui transmisi seksual (PMTS) menargetkan 80% populasi kunci (termasuk LSL) terjangkau dengan program yang efektif dan 60% populasi kunci berperilaku hidup sehat serta menggunakan kondom setiap kali berhubungan seks berisiko (<em>safesex</em>). Namun hal ini sangat sulit diterapkan terutama pada komunitas LSL. Walaupun mereka memiliki tingkat pengetahuan tentang IMS dan HIV/AIDS yang memadai, namun hal ini tidak dapat merubah perilaku seksual berisiko mereka. Hal ini seperti pada hasil beberapa penelitian terbaru yang menunjukkan bahwa tidak ada pengaruh antara pengetahuan dan sikap tentang HIV/AIDS dengan tindakan pencegahan HIV/<a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">AIDS pada komunitas LSL</a>.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Berdasarkan kondisi yang disebutkan di atas, maka pendekatan program PMTS melalui sosialisasi&nbsp;<em>safesex</em>&nbsp;pada komunitas LSL tidak efektif dalam menurunkan prevalensi IMS dan HIV/AIDS. Terbukti penemuan kasus baru pada komunitas LSL cenderung naik baik dari sisi jumlah maupun usia yang semakin muda. Hal ini diperburuk dengan hasil indept interview yang menunjukkan berbagai kendala dalam menerapkan safesex pada komunitas LSL, yaitu terkendala oleh alasan kenikmatan dan kenyamanan pada saat melakukan hubungan seksual dengan pasangan dekat atau pacar, sehingga perilaku berisiko seperti bergonta ganti pasangan tanpa kondom masih banyak terjadi. Kepedulian yang tinggi pada risiko terhadap HIV/AIDS tidak memiliki hubungan pada penggunaan kondom diantara 40 LSL Filipina (Malonzo et al, 2011).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Dalam hal ini bisa dijelaskan bahwa apabila komunitas LSL merasa nyaman dengan tidak menerapkan&nbsp;<em>safesex</em>, maka hal ini akan menjadi ancaman bagi kelompok masyarakat yang lain akan kemungkinan penyebaran IMS dan HIV/AIDS yang tidak terkendali. Mengingat ada kalanya pasangan seks LSL berasal dari laki-laki heteroseksual atau biseksual&nbsp; yang bisa melakukan hubungan seks dengan istri atau perempuan lain. Departemen Kesehatan dan FHI pada tahun 2012 melakukan studi terhadap 275 LSL memberikan gambaran betapa jaringan seksual diantara kelompok berisiko sangatlah rumit. Laki-laki penjaja seks yang pelanggannya adalah homoseksual (gay), ternyata juga membeli seks dari wanita penjaja seks (WPS) (Praptorahardjo dkk, 2014).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Dari kondisi yang telah disebutkan di atas, maka sebuah keharusan bagi pemerintah untuk merubah strategi pelaksanaan&nbsp;<a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">kebijakan kesehatan</a>&nbsp;terkait penanggulangan HIV/AIDS dari pendekatan&nbsp;<em>preventive</em>&nbsp;dan&nbsp;<em>promotive</em>melalui program PMTS (dengan sosialisasi&nbsp;<em>safesex</em>) menjadi pendekatan&nbsp;<em>preventive</em>&nbsp;dan&nbsp;<em>promotive</em>&nbsp;melalui pendidikan kesehatan reproduksi di SMP dan SMA. Dengan pendekatan model seperti ini dapat menumbuhkan rasa percaya diri pada identitas seksual mereka sejak usia remaja, termasuk dalam menjalin relasi seksual dengan orang lain yang lebih bijak dan bertanggung jawab terhadap pilihan hidup sebagai heteroseksual atau homoseksual. Terdapat multi faktor termasuk atribut psikologis dimana perilaku promosi kesehatan (<em>Health promoting Behaviour</em>) dan faktor biologis mempengaruhi kemampuan seseorang untuk membuat perubahan pada gaya hidupnya. Konsep&nbsp;<em>self-esteem</em>,&nbsp;<em>self-efficacy</em>&nbsp;dan harapan memiliki hubungan yang kuat dan konsisten dengan perilaku promosi kesehatan (Klein-Hessling et al., 2005).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Pendekatan preventif dan promotif dalam kebijakan penanggulangan HIV/<a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">AIDS pada komunitas LSL</a>&nbsp;sangat diperlukan dalam rangka menurunkan prevalensi IMS dan HIV/AIDS baik dari sisi jumlah maupun dari sisi usia pertama kali terinfeksi. Hal ini seperti pada penerapan salah satu dari delapan elemen yang harus tercakup dan menentukan kualitas dari sebuah&nbsp; kebijakan menurut WHO yaitu pendekatan holistik yang artinya bahwa pendekatan dalam&nbsp;<a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">kebijakan kesehatan</a>&nbsp;tidak dapat semata-mata mengandalkan upaya kuratif, tetapi harus lebih mempertimbangkan upaya preventif, promotif dan rehabilitatif (Ayuningytas, 2014). Dalam kebijakan terbaru yang dikeluarkan oleh Kemenkes, yakni Permenkes No 21 tahun 2013 disebutkan pada bagian II, Pasal 9 (7d) disebutkan bahwa gay, waria, dan laki-laki pelanggan/pasangan Seks dengan sesama Lelaki adalan sasaran promosi kesehatan (Suharni, 2014). Generasi muda atau remaja LSL diharapkan menjadi target, secara alami terhadap promosi kesehatan yang menyediakan pemahaman yang benar tentang pencegahan dan penularan HIV ( Lachowsky et al, 2014).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\"><strong>Belajar dari Kabupaten Jember Dalam Penanggulangan HIV dan AIDS pada LSL</strong></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Kabupaten Jember adalah salah satu kota yang terletak di bagian timur Propinsi Jawa Timur. Data yang dilaporkan oleh Dinas Kesehatan dan KPAD kabupaten Jember, angka HIV/AIDS sejak 10 terakhir terus mengalami peningkatan. Bahkan data terakhir peringkat Kabupaten Jember naik menjadi posisi ketiga di Jawa Timur sebagai Kabupaten penyumbang HIV/AIDS terbesar setelah Kota Surabaya dan Kabupaten Malang (PKBI Propinsi Jawa Timur, 2014). Pada tahun 2004 merupakan tahun awal kasus HIV/AIDS di Jember pertama kali ditemukan, yaitu sebesar 1 kasus, dan terus meningkat setiap tahun hingga tahun 2014 bulan Agustus jumlah kumulatif kasus HIV/AIDS di Kabupaten Jember&nbsp; sudah mencapai 1433 kasus (Dinas Kesehatan Kabupaten Jember, 2014).</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Dari jumlah total ODHA tersebut, berdasarkan faktor risiko, penularan melalui heteroseksual sebesar 1232 kasus (85,97%).Sedangkan urutan kedua adalah dari hubungan homoseksual. Yaitu hubungan seks antara sesama jenis termasuk didalamnya laki-laki berhubungan seks dengan laki-laki, termasuk para waria berhubungan seks dengan laki-laki.&nbsp; Sama halnya dengan fenomena data di tingkat nasional, bahwa ada tren baru yang menarik dalam penemuan kasus HIV/AIDS dikalangan LSL (laki-Laki suka seks dengan Laki-laki), termasuk di Kabupaten Jember. Dalam 3 tahun terakhir, ditemukan kasus HIV/AIDS baru pada LSL dengan prevalensi yang cukup tinggi.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Sampai dengan bulan Agustus 2014, kasus HIV/AIDS pada faktor risiko homoseks (LSL) sebesar 101 kasus (7,05%). Peningkatan prevalensi HIV pada populasi LSL menjadi perhatian khusus pemerintah Kabupaten Jember melalui KPAD. Program penanggulangan AIDS pada populasi LSL selama ini telah menerapkan berbagai metode untuk merubah perilaku yang berisiko tinggi, diantaranya melalui program PMTS. Namun hal ini tidak membawa perubahan signifikan terhadap penurunan penemuan kasus baru HIV dan AIDS dikalangan LSL di Kabupaten Jember. Maka dari itu diperlukan pendekatan baru dalam stategi pelaksanaan program&nbsp;<em>preventive</em>&nbsp;dan&nbsp;<em>promotive</em>dengan sasaran remaja SMP dan SMA yang bertujuan untuk menanamkan pendidikan kesehatan reproduksi yang di dalamnya terdapat pemahaman seksualitas sejak dini agar mereka memiliki rasa percaya diri pada identitas seksual mereka sejak usia remaja, termasuk dalam menjalin relasi seksual dengan orang lain yang lebih bijak dan bertanggung jawab terhadap pilihan hidup sebagai heteroseksual atau homoseksual. Hal ini telah dilaksanakan oleh LSM Laskar dengan sasaran remaja melalui kegiatan : Edukasi tentang HIV dan AIDS termasuk di dalamnya materi tentang kesehatan reproduksi remaja di sekolah SMP, SMA dan Perguruan Tinggi serta pondok pesantren. Selain itu LSM Laskar bekerjasama dengan Karang Taruna dan PIK-R&nbsp; (Pusat Informasi Kesehatan Reprodukdi Remaja) yang terdapat di kelurahan atau kecamatan dengan membentuk PIKM (Pusat Informasi Kesehatan Masyarakat) yang berasal dari komunitas LSL, serta membina peer educator dari komunitas LSL.&nbsp;</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\"><strong>Daftar Pustaka</strong></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Ayuningytas, D. (2014).&nbsp;<em><a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">Kebijakan Kesehatan</a>; Prinsip dan Praktik</em>. Jakarta : PT Raja Grafindo Persada.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Direktorat Jendral P2 &amp; PL Kemenkes RI. (2014).&nbsp;<em>Statistik Kasus HIV/AIDS di Indonesia Per Juni 2014</em>. Jakarta : Ditjen P2 &amp; PL Kemenkes RI.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Klein-Hessling, J., Lohaus, A. Ball, J. (2005). Psycological Predictors of Health-Related Behaviour in Children.<em>Psycology, Health &amp; Medicine</em>, 10 (1), 31-43.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Komisi&nbsp;Penanggulangan&nbsp;AIDS Nasional. 2010.&nbsp;<em>Pedoman Program Pencegahan HIV&nbsp;Melalui Transmisi Seksual</em>.&nbsp;Jakarta: Komisi&nbsp;Penanggulangan&nbsp;AIDS Nasional.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Komisi Penanggulangan AIDS Kabupaten Jember. 2014.&nbsp;<em>Laporan Situasi HIV/AIDS Bulan Mei 2014</em>. Jember : KPA Kabupaten Jember.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Lachowsky, N.J, Saxton, P.JW, Dickson, N.P, Hughes, A.J, Summerlee, A.J.S,Dewey, J.E, (2014).<em>Factors associated with recent HIV testing among younger gay and bisexual men in New Zealand, 2006-2011</em>. BMC Public Health 2014, 14:294 doi:10.1186/1471-2458-14-294.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Malonzo, E. M., &amp; Felix Jr, C. C. (2013). Sexual-Esteem, Sexual Self Efficacy and Sexual Risk Cognitions of Men Who Have Sex with Men (MSM) In Davao City.<em>Southeast Asian Interdisciplinary Research Journal</em>, 1(1), 59-76.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Praptorahardjo, I. Suharni, Pudjiati, S.R. Hersumpana, Setiawan, E.P, Bolilanga, S. Dewi, E.H. (2014).&nbsp;<em><a href=\"http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl#\" style=\"color: rgb(200, 21, 23);\">Kebijakan HIV</a>&nbsp;&amp; AIDS dalam Sistem Kesehatan di Indonesia : Ringkasan Kajian Dokumen</em>. Yogyakarta : Pusat Kebijakan dan Manajemen Kesehatan Fakultas Kedokteran Universitas Gadjah Mada dan Departement of Foreign affairs and Trade, Austalian Government.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Suharni, M. (2014).<em>Menelusuri Kebijakan, Penganggulangan HIV &amp; AIDS Pada Laki-Laki Seks Dengan Laki-Laki&nbsp; Dan Jaringannya</em>.&nbsp;<a href=\"http://kebijakanaidsindonesia.net/\" target=\"_blank\" style=\"color: rgb(200, 21, 23);\">Http://kebijakanaidsindonesia.net</a></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Sumber :&nbsp;http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1044-close-the-gap-belajar-dari-daerah-dalam-penanggulangan-hiv-aids-pada-komunitas-lsl</p>','1472377478087-DSC01289.JPG','1','2016-08-28 09:44:38',NULL),(121,2,2,'Model Pendanaaan bagi LSM untuk Program Penanggulangan AIDS','Wacana model contracting out bagi LSM dalam program penanggulangan HIV dan AIDS, ternyata menjadi topik yang hangat dan menarik untuk didiskusikan.','<p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Wacana model contracting out bagi LSM dalam program penanggulangan HIV dan AIDS, ternyata menjadi topik yang hangat dan menarik untuk didiskusikan. Menjadi angin segar bagi LSM untuk dapat mengakses pendanaan dari pemerintah untuk kegiatan yang&nbsp; berjangka panjang.&nbsp; Selama ini pemerintah telah mengalokasikan pendanaannnya melalui dana bantuan sosial bagi LSM, namun tidak spesifik untuk program dan tidak dapat dipergunakan untuk operasional lembaga, sehingga berakibat pada kelangsungan hidup LSM menjadi tidak stabil.&nbsp; Pengalaman penanggulangan AIDS di Indonesia menunjukkan bahwa pemerintah tidak bisa melakukan semua pelayanan yang diperlukan, apalagi untuk promosi dan pencegahan. Sehingga model mengontrak LSM untuk kerja penanggulangan AIDS menjadi cukup masuk akal.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Model penyaluran dana pemerintah kepada LSM untuk program penanggulangan AIDS memang belum dilakukan di Indonesia, namun model ini sudah dilakukan dibeberapa negara lain termasuk&nbsp; Malaysia dan Australia. Study banding&nbsp; yang diadakan oleh HCPI dengan fasilitasi Burnett Institute dilakukan &nbsp;di kedua negara tersebut untuk mempelajari mekanisme penyaluran dana pemerintah kepada CSO/NGO. &nbsp;Melalui hasil pembelajaran di kedua negara tersebut direkomendasikan kepada pemangku kebijakan &nbsp;untuk mengembangkan mekanisme&nbsp; pendanaan bagi LSM/Masyarakat sipil dalam penanggulangan HIV dan AIDS.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Study banding tersebut menunjukkan bahwa dua negara ini &nbsp;mempunyai pengalaman yang memungkinkan program pemerintah termasuk pendanaan pengendalian HIV/AIDS dilaksanakan oleh LSM dengan berbagai mekanisme. Mekanisme tersebut&nbsp; didukung dengan peraturan yang kuat, sistem registrasi dan akreditasi LSM yang kuat, serta kesepakatan perjanjian pelayanan yang kuat. Penanganan masalah terkait HIV oleh institusi berbasis masyarakat/komunitas yang diinisiasi oleh masyarakat melalui pendanaan dan pengelolaan secara mandiri dapat diperbesar dampak positifnya (outcome expansion) melalui bantuan pendanaan dari pemerintah, baik pemerintah pusat maupun pemerintah daerah.&nbsp; Model pendanaan publik kepada organisasi masyarakat berpotensi menimbulkan kompleksitas dalam sistem perencanaan dan penganggaran, oleh karena itu perlu adanya aturan tentang pembiayaan LSM yang mengatur kontrak, kinerja dan transparansi. Dalam hal ini, perlu menyusun sebuah sistem kendali melalui penugasan kepada lembaga yang ada atau membentuk lembaga pemerintah maupun non-pemerintah yang dapat menjembatani penjaminan pencapaian kinerja dan akuntabilitas keuangan.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\"><br></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Sumber :&nbsp;http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1284-model-pendanaaan-bagi-lsm-untuk-program-penanggulangan-aids</p>','1472377308518-Burnet_Institute.jpg','1','2016-08-28 09:41:48',NULL),(131,2,2,'Stigma dan Diskriminasi Terhadap ODHA, Tugas dan Tanggungjawab Siapa?','Stigma dan diskriminasi telah menjadi hukuman sosial oleh masyarakat di berbagai belahan dunia terhadap pengidap HIV/AIDS yang bisa bermacam-macam bentuknya, antara lain berupa tindakan-tindakan pengasingan, penolakan, diskriminasi, dan penghindaran atas orang yang terinfeksi HIV.','<p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Stigma dan diskriminasi telah menjadi hukuman sosial oleh masyarakat di berbagai belahan dunia terhadap pengidap HIV/AIDS yang bisa bermacam-macam bentuknya, antara lain berupa tindakan-tindakan pengasingan, penolakan, diskriminasi, dan penghindaran atas orang yang terinfeksi HIV. Tindakan diskriminasi dan stigmatisasi membuat orang enggan untuk melakukan tes HIV, enggan mengetahui hasil tes mereka, dan tidak berusaha untuk memperoleh perawatan yang semestinya serta cenderung menyembunyikan status penyakitnya. Hal ini semakin memperburuk keadaan, membuat penyakit yang tadinya dapat dikendalikan menjadi semacam “hukuman mati” bagi para pengidapnya dan membuat penyakit ini makin meluas penyebarannya secara terselubung.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Stigma dan diskrimansi terhadap ODHA merupakan tantangan yang bila tidak teratasi, potensial untuk menjadi penghambat upaya penanggulangan HIV dan AIDS. Diskriminasi yang dialami ODHA baik pada unit pelayanan kesehatan, tempat kerja, lingkungan keluarga maupun di masyarakat umum harus menjadi prioritas upaya penanggulangan HIV dan AIDS. Oleh sebab itu perlu dukungan dan perberdayaan kelompok-kelompok dukungan sebaya (KDS) sebagai mitra kerja yang efektif dan mahasiswa sebagai kelompok yang potensial dalam mengurangi stigma dan diskriminasi (Komisi Penanggulangan AIDS, 2007).&nbsp;</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\"><strong>Epidemi HIV/AIDS</strong></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">HIV/ AIDS telah menjadi pandemi dan masalah kesehatan di seluruh dunia. Data surveilans WHO (2013) menunjukkan jumlah orang dengan HIV/AIDS per wilayah negara tahun 2011 untuk semua golongan umur sebagai berikut: Afrika menempati urutan pertama dengan jumlah 23 juta kasus, Asia Tenggara 3.5 juta kasus, Amerika 3 juta kasus, Eropa 2.3 juta kasus, Pasifik Barat 1.3 juta kasus, dan terakhir Mediterania Timur 560 ribu kasus. Total jumlah kasus secara global adalah 34 juta kasus.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Secara kumulatif sejak 1 April 1987 hingga Desember 2012 kasus HIV/AIDS di Indonesia berdasarkan laporan Ditjen PP &amp; PL Kemenkes RI (2013) terdapat 98.390 HIV dan 45.499 AIDS dengan total kematian 7.293 kasus. Dari jumlah kumulatif ini Sulawesi Selatan menempati urutan ke-8 dengan total 2.972 kasus HIV, dan 1.446 AIDS dengan 167 kematian. Provinsi ini juga melaporkan peningkatan jumlah kasus terbanyak pertama dari seluruh propinsi di Indonesia yaitu 404 kasus dan menempati urutan ke-12 tertinggi prevalensi kasus AIDS diantara 33 propinsi di Indonesia yaitu 18/100.000 penduduk.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Data Dinas Kesehatan Propinsi Sulawesi Selatan jumlah kumulatif HIV/AIDS tahun 2005 sampai dengan Juni 2012 masing-masing sebagai berikut: tahun 2005 HIV 408, AIDS 176, tahun 2006 HIV 511 sedangkan AIDS 137, tahun 2007 HIV 393,&nbsp; AIDS 219, tahun 2008 meningkat HIV 456, AIDS 90, tahun 2009 HIV 562 sedangkan AIDS 153, tahun 2010 HIV 548 sedangkan AIDS 246, tahun 2011 baik HIV &amp; AIDS meningkat tajam HIV 607 kasus sedangkan AIDS 650, tahun 2012 HIV 629, AIDS 354, tahun 2013 sampai dengan bulan September&nbsp; HIV 647 dan AIDS 361 kasus.&nbsp;</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Stigma dan Diskriminasi</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Stigma dan diskriminasi tidak hanya dilakukan oleh masyarakat awam, namun juga dilakukan oleh petugas kesehatan baik dokter dan perawat serta mahasiswa yang perpendidikan tinggi juga ikut melakukan diskriminasi dan stigmatisasi. Di sisi lain para petugas kesehatan baik dokter atau perawat yang dalam keseharianya sering menangangani pengidap penyakit ini juga biasanya mendapatkan perlakuan diskriminasi dan stigma oleh masyarakat, seperti contohnya jika sakit mereka menghindari untuk terlihat berobat atau menolak untuk ditangani oleh dokter dan petugas kesehatan yang biasa menangani pengidap HIV/AIDS.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Herek et al (2002) menemukan bahwa ekspresi nyata dari stigmatisasi HIV/ AIDS di Amerika pada tahun 1999, 1 dari 5 orang dewasa yang disurvei mengatakan mereka \"takut\" pada orang dengan AIDS. Satu dari 6 orang mengaku \"jijik\" berhubungan dengan orang-orang dengan AIDS. Penelitian lain yang dilakukan pada tahun 2000, sebuah survei internet nasional terhadap lebih dari 5600 orang dewasa Amerika, mengungkapkan temuan serupa. Kurang lebih 1 dari 5 orang responden setuju dengan pernyataan bahwa orang-orang yang terkena AIDS melalui hubungan seks atau penggunaan narkoba layak mendapatkan apa yang mereka derita sekarang.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Survei awal yang dilakukan melibatkan 10 orang mahasiswa FKM UMI dengan cara wawancara didapatkan bahwa masih terdapat 4 orang diantara 10 orang yang diwawancarai mengaku ‘takut’ bergaul dengan Odha dengan alasan khawatir jika bergaul dengan mereka akan tertular. Saat ditanyakan, bagaimana sikap mereka jika ada teman mereka yang menderita HIV, keempat orang tersebut memilih untuk menjauhinya. Padahal para mahasiswa tersebut umumnya sudah mendapatkan matakuliah Epidemiologi Penyakit Menular yang juga membahas tentang cara penularan virus HIV, namun mereka masih saja melakukan stigmatisasi terhadap Odha.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\"><strong>Upaya Mengurangi Stigma</strong></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Stigma yang terkait dengan penyakitnya merupakan tantangan psikologis tersendiri untuk Odha. Saat mereka diketahui mengidap HIV, perlahan tapi pasti satu persatu teman-temannya menjauhi, bahkan tak jarang keluarganya pun&nbsp; menjauhi. Padahal, disaat seperti ini Odha sangat membutuhkan dukungan penuh dari lingkungan sosialnya, karena mereka mengalami tekanan psikologis yang cukup berat akibat dinyatakan terinfeksi HIV.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Nasronuddin 2007, mengungkapkan bahwa terjadi peningkatan kadar ACTH dan kadar&nbsp;<em>kortisol</em>&nbsp;dalam tujuh hari pertama yang dipicu oleh stressor psikologis akibat dinyatakan terinfeksi HIV, selain akibat stressor psikologis peningkatan setelah hari ke tujuh terjadi akibat stressor biologis HIV, dari sini dapat dilihat bahwa efek dari pernyataan diagnosis mengidap HIV terhadap seseorang sangat signifikan meningkatkan tingkat stress, belum lagi menghadapi reaksi keluarga dan teman-teman yang perlahan tapi pasti beranjak menjauh.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Dengan berusaha mencoba memahami pengalaman hidup yang dialami pengidap HIV akan menyebabkan hasil psikologis yang positif untuk membantu meningkatkan kualitas hidup orang dengan HIV/ AIDS (<a href=\"http://www.ncbi.nlm.nih.gov/pmc/articles/PMC3355931/#R44\" target=\"_blank\" style=\"color: rgb(200, 21, 23);\">Treisman &amp; Angelino, 2004)</a>. Memberikan pengertian dan pengetahuan yang memadai kepada masyarakat terutama kepada mahasiswa sebagai intelektual muda menjadi suatu hal yang sangat penting, mahasiswa yang notabene kisaran usianya kurang lebih sama dengan rata-rata usia odha tentunya akan lebih mudah mengerti dan tersentuh jika belajar dan bergaul langsung dari odha tentang pengalaman pahitnya menghadapi stigmatisasi, dilain pihak odha akan lebih merasa nyaman mengungkapkan statusnya kepada mereka yang usianya kurang lebih sama dengan mereka.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Stigma dan diskriminasi biasanya terjadi akibat ketakutan yang berlebihan akan tertular penyakit ini. Masalah lain yaitu penyakit ini dianggap sangat mematikan dan belum ditemukan obatnya, serta anggapan bahwa penyakit tersebut hanya ditularkan akibat dari perilaku menyimpang sehingga dianggap merupakan aib bagi pengidap dan keluarganya. Padahal, jika benar-benar dipahami dan dimengerti cara penularanya, sebenarnya penyakit ini dapat dicegah tanpa harus menjauhi apalagi sampai melakukan stigma dan diskriminasi terhadap para pengidapnya.&nbsp; Dibutuhkan berbagai penelitian aplikatif, konsisten agar terwujud peran serta berbagai pihak dalam upaya menurunkan stigma dan diskriminasi yang dialami Odha, sehingga mereka mau lebih terbuka mengenai penyakitnya yang makin memudahkan upaya pencegahan penularan terselubung dan memudahkan odha mengakses pelayanan kesehatan yang adekuat tanpa rasa takut akan menghadapi stigma dan diskriminasi.</p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\"><br></p><p style=\"font-size: 14px; line-height: 21px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" text-align:=\"\" justify;\"=\"\">Sumber :&nbsp;http://www.kebijakanaidsindonesia.net/id/artikel/artikel-kontribusi/1005-stigma-dan-diskriminasi-terhadap-odha-tugas-dan-tanggungjawab-siapa</p>','1472376735813-1650607_orig.jpg','1','2016-08-28 09:32:16',NULL),(141,1,2,'Sebanyak 188 Penderita AIDS di Sukabumi Meninggal Dunia','SUKABUMI - Data Komisi Penanggulangan AIDS (KPA) Kabupaten Sukabumi, Jawa Barat tercatat sejak 2004 hingga 2016 ini sudah ada 118 orang dengan HIV/AIDS yang meninggal dunia.\"Untuk','<p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><strong style=\"margin: 0px; padding: 0px;\">SUKABUMI</strong> - Data Komisi Penanggulangan AIDS (KPA) Kabupaten Sukabumi, Jawa Barat tercatat sejak 2004 hingga 2016 ini sudah ada <span style=\"font-weight: bold;\">118</span> orang dengan HIV/AIDS yang meninggal dunia.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Untuk total pengidap HIV dan AIDS sejak 2004 mencapai 572 orang. Untuk ODHA yang meninggal dunia karena kondisi kekebalan tubuh mereka sudah tidak bisa lagi menahan perkembangbiakan virus dalam tubuhnya,\" kata Seketaris KPA Kabupaten Sukabumi, Asep Surahman di Sukabumi, Senin (8/8/2016).<br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Menurutnya, ODHA yang meninggal dunia tersebut mereka yang masuk fase AIDS, biasanya mereka terserang penyakit penyerta lainnya seperti TBC, flu yang berkepanjangan dan lain-lain.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Jika orang yang positif HIV dan masuk fase AIDS daya tahan tubuhnya menurun drastis dan mudah terserang penyakit, maka dari itu, untuk menjaga kekebalan tubuhnya ODHA diwajibkan mengkonsumsi obat Antiretroviral atau ARV secara rutin dan berkelanjutan.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Selain itu, untuk dosisnya pun sesuai jumlah virus HIV yang ada di dalam tubuhnya dan dalam mengkonsumsi obat tersebut jangan sampai ada jeda karena virus akan cepat berkembangbiak dan terus menggerogoti daya tahan tubuh orang yang terinfeksi.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Pada tahun ini saja ada 57 kasus baru penularan HIV, mayoritas orang yang tertular tersebut berada di usia produktif, bahkan ada juga anak-anak,\" tambahnya.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Asep mengatakan dalam beberapa tahun terakhir ini ada perubahan tren cara penularan HIV yang awalnya mayoritas ODHA tertular karena jarum suntik yang digunakan untuk memasukan narkoba ke dalam tubuh atau pengguna narkoba suntik (penasun).</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Namun, untuk saat ini mayoritas penularannya melalui hubungan seks, sehingga banyak kaum hawa khususnya ibu rumah tangga yang tertular penyakit ini. Untuk itu pihaknya mengimbau kepada masyarakat agar menjauhi perilaku yang bisa menyebabkan tertular penyakit mematikan ini.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Seperti setia pada pasangan atau tidak gonta ganti pasangan, melakukan hubungan seks secara sehat dan tidak menyimpang serta jauhi penggunaan narkoba.</p><p><br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Warga harus secara rutin memeriksakan kesehatannya, jika positif maka kami akan segera melakukan penanggulangan seperti memberikan terapi dan obat ARV agar daya tubuhnya tetap terjaga serta memberikan pembiaan dan semangat kepada ODHA,\" katanya.</p><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><br></p></div><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Sumber : http://news.okezone.com/read/2016/08/08/525/1457974/188-penderita-aids-di-sukabumi-meninggal-dunia</p></div>','1472378009055-188-penderita-aids-di-sukabumi-meninggal-dunia-zFJOpz6KEJ.jpg','1','2016-08-28 09:53:29',NULL),(151,2,2,'Terapi Antiretroviral (ARV)','Apa Terapi Antiretroviral Itu?Terapi antiretroviral (ART) berarti mengobati infeksi HIV dengan beberapa obat. Karena HIV adalah retrovirus, obat ini biasa disebut sebagai obat antiretroviral (ARV).','<h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Apa Terapi&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">Antiretroviral</span>&nbsp;Itu?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Terapi antiretroviral (<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">ART</span>) berarti mengobati infeksi HIV dengan beberapa obat. Karena HIV adalah&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">retrovirus</span>, obat ini biasa disebut sebagai obat antiretroviral (ARV). ARV tidak membunuh<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">virus</span>&nbsp;itu. Namun, ART dapat melambatkan pertumbuhan virus. Waktu pertumbuhan virus dilambatkan, begitu juga penyakit HIV.</p><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Apa Siklus Hidup HIV Itu?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Ada beberapa langkah dalam siklus hidup HIV (lihat&nbsp;<a href=\"http://spiritia.or.id/li/bacali.php?lino=106\" style=\"color: rgb(153, 0, 0);\">Lembaran Informasi (LI) 106</a>&nbsp;untuk gambar):</p><ol style=\"color: rgb(0, 0, 0); font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" medium;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Virus bebas beredar dalam aliran darah</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">HIV mengikatkan diri pada sel</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">HIV menembus sel dan mengosongkan isinya dalam sel</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Kode genetik HIV diubah dari bentuk&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">RNA</span>&nbsp;menjadi bentuk&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">DNA</span>&nbsp;dengan bantuan oleh<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">enzim</span>&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">reverse transcriptase</span></li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">DNA HIV dipadukan dengan DNA sel dengan bantuan oleh enzim&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">integrase</span>. Dengan pemaduan ini, sel tersebut menjadi terinfeksi HIV.</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Waktu sel yang terinfeksi menggandakan diri, DNA HIV diaktifkan, dan membuat bahan baku untuk virus baru</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Semua bahan yang dibutuhkan untuk membuat virus baru dikumpulkan</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Virus yang belum matang mendesak ke luar sel yang terinfeksi dengan proses yang disebut ‘<i>budding</i>&nbsp;(tonjolan)’</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Jutaan virus yang belum matang dilepas dari sel yang terinfeksi</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Virus baru menjadi matang: bahan baku dipotong oleh enzim&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">protease</span>&nbsp;dan dirakit menjadi virus yang siap bekerja</li></ol><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">ARV yang Disetujui di AS</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Setiap tipe atau ‘<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">golongan</span>’ ARV menyerang HIV dengan cara berbeda. Saat ini ada lima golongan obat disetujui di AS.</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Golongan obat anti-HIV pertama adalah&nbsp;<strong>nucleoside reverse transcriptase inhibitor</strong>&nbsp;atau NRTI, juga disebut&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">analog nukleosida</span>. Obat golongan ini menghambat langkah keempat di atas, yaitu perubahan bahan genetik HIV dari bentuk RNA menjadi bentuk DNA yang dibutuhkan dalam langkah berikut. Obat dalam golongan ini yang disetujui di AS dan masih dibuat adalah:</p><ul style=\"color: rgb(0, 0, 0); font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" medium;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">3TC (lamivudin)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Abacavir (ABC)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">AZT (ZDV, zidovudin)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">d4T (stavudin)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">ddI (didanosin)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Emtrisitabin (FTC)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Tenofovir (TDF;&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">analog nukleotida</span>)</li></ul><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><strong>Non-nucleoside reverse transcriptase inhibitor</strong>&nbsp;atau NNRTI menghambat langkah yang sama dalam siklus hidup HIV, tetapi dengan cara lain. Lima NNRTI disetujui di AS:</p><ul style=\"color: rgb(0, 0, 0); font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" medium;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Delavirdin (DLV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Efavirenz (EFV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Etravirin (ETV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Nevirapin (NVP)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Rilpivirin (RPV)</li></ul><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><strong><span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">Protease inhibitor</span></strong>&nbsp;(PI) menghambat langkah kesepuluh, dengan bahan virus baru dipotong sesuai untuk membuat virus baru. Sembilan PI disetujui dan masih dibuat di AS:</p><ul style=\"color: rgb(0, 0, 0); font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" medium;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Atazanavir (ATV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Darunavir (DRV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Fosamprenavir (FPV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Indinavir (IDV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Lopinavir (LPV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Nelfinavir (NFV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Ritonavir (RTV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Saquinavir (SQV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Tipranavir (TPV)</li></ul><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><strong>Entry inhibitor</strong>&nbsp;mencegah pengikatan dan pemasukan HIV pada sel dengan menghambat langkah kedua dari siklus hidupnya. Dua obat golongan ini sudah disetujui di AS:</p><ul style=\"color: rgb(0, 0, 0); font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" medium;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Enfuvirtid (T-20)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Maraviroc (MVC)</li></ul><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><strong><span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">Integrase inhibitor</span></strong>&nbsp;(INI). Obat golongan ini mencegah pemaduan kode genetik HIV dengan kode genetik sel dengan menghambat langkah kelima dari siklus hidupnya. Sudah tersedia tiga obat INI:</p><ul style=\"color: rgb(0, 0, 0); font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" medium;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Dolutegravir (DTG)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Elvitegravir (EGV)</li><li style=\"margin-top: 0px; padding-top: 0px; line-height: 1.25em; font-size: 11pt;\">Raltegravir (RGV)</li></ul><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Namun elvitegravir hanya disetujui sebagai kandungan dalam Stribild, pil kombinasi dengan cobicistat, emtricitabine dan tenofovir.</p><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Bagaimana Obat Ini Dipakai?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Obat ARV umumnya dipakai dalam gabungan dengan tiga atau lebih ARV dari lebih dari satu golongan. Hal ini disebut sebagai&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">terapi kombinasi</span>, atau ART. ART bekerja jauh lebih baik daripada hanya satu ARV sendiri. Cara penggunaan obat ini mencegah munculnya&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">resistansi</span>.</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Produsen ARV terus-menerus berupaya untuk membuat obatnya lebih mudah dipakai, dan sudah menggabung dua atau lebih jenis obat dalam satu pil.</p><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Apa Resistansi terhadap Obat Itu?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Waktu HIV menggandakan diri, sebagian dari bibit HIV baru dapat menjadi sedikit berbeda dengan aslinya. Jenis berbeda ini disebut&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">mutan</span>. Kebanyakan mutan langsung mati, tetapi beberapa di antaranya terus menggandakan diri, walaupun kita tetap memakai ART – mutan tersebut ternyata kebal terhadap obat. Jika ini terjadi, obat tidak bekerja lagi. Hal ini disebut sebagai ‘mengembangkan resistansi’ terhadap obat tersebut. Lihat&nbsp;<a href=\"http://spiritia.or.id/li/bacali.php?lino=126\" style=\"color: rgb(153, 0, 0);\">LI&nbsp;126</a>&nbsp;untuk informasi lebih lanjut tentang resistansi.</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Jika hanya satu jenis ARV dipakai, virus secara mudah mengembangkan resistansi terhadapnya. Oleh karena itu, penggunaan hanya satu jenis ARV (yang disebut&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">monoterapi</span>) tidak dianjurkan. Tetapi jika dua jenis obat dipakai, virus mutan harus unggul terhadap dua obat ini sekaligus. Dan jika tiga jenis obat dipakai, kemungkinan munculnya mutan yang dapat sekaligus unggul terhadap semuanya sangat kecil. Penggunaan kombinasi tiga jenis ARV berarti membutuhkan jauh lebih lama untuk mengembangkan resistansi.</p><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Apakah Obat Ini Dapat Menyembuhkan AIDS?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Saat ini, belum ditemukan penyembuh infeksi HIV. ARV mengurangi&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">viral load</span>, yaitu jumlah HIV dalam aliran darah kita. Kalau viral load kita lebih rendah, kita tetap sehat lebih lama. Kita juga kurang mungkin menularkan HIV pada orang lain. Lihat&nbsp;<a href=\"http://spiritia.or.id/li/bacali.php?lino=125\" style=\"color: rgb(153, 0, 0);\">LI&nbsp;125</a>&nbsp;untuk informasi lebih lanjut tentang tes viral load.</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Viral load beberapa orang menjadi begitu rendah sehingga tidak dapat diukur oleh tes viral load; viral loadnya disebut ‘tidak&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">terdeteksi</span>’. Ini&nbsp;<strong>bukan</strong>&nbsp;berarti virus hilang, dan tidak berarti orang tersebut ‘sembuh’.</p><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Kapan Sebaiknya Kita Mulai?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Belum ada jawaban yang jelas untuk pertanyaan ini. Sebagian besar dokter akan mempertimbangkan jumlah CD4, dan&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">gejala</span>&nbsp;yang kita alami. Menurut pedoman WHO, ART sebaiknya dimulai sebelum CD4 turun di bawah 350, bila kita hamil, kita alami TB aktif, kita membutuhkan terapi untuk virus&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">hepatitis</span>&nbsp;B (<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">HBV</span>), atau kita mempunyai gejala penyakit terkait HIV yang sedang atau berat. Kriteria untuk mulai ditentukan dalam Pedoman ART Kemenkes (lihat&nbsp;<a href=\"http://spiritia.or.id/li/bacali.php?lino=404\" style=\"color: rgb(153, 0, 0);\">LI&nbsp;404</a>). Keputusan untuk memulai ART sangat penting, dan sebaiknya dibahas dahulu dengan dokter. Untuk informasi lebih lanjut mengenai mulai ART, lihat buku kecil Yayasan Spiritia “Pengobatan untuk AIDS: Ingin Mulai?”</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Obat Apa yang Sebaiknya Kita Pakai?</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">ARV dipilih berdasarkan resistansi HIV terhadap obat, kesehatan kita (misalnya, ada penyakit hati atau ginjal) dan faktor pola hidup. Namun tidak semua ARV di atas tersedia di Indonesia, sehingga pilihan berdasarkan Pedoman ART. Sementara&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">paduan</span>&nbsp;ART umumnya ditahan dengan baik, setiap ARV, sama seperti semua obat lain, dapat menimbulkan&nbsp;<span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">efek samping</span>&nbsp;(lihat&nbsp;<a href=\"http://spiritia.or.id/li/bacali.php?lino=550\" style=\"color: rgb(153, 0, 0);\">LI&nbsp;550</a>). Beberapa efek samping ini gawat. Lihat Lembaran Informasi untuk masing-masing obat. Setiap orang berbeda, dan kita, bersama dengan dokter, harus memutuskan obat apa yang kita pilih.</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><span class=\"addspeech\" title=\"\" style=\"border-bottom: 3px double green;\">Kepatuhan</span>&nbsp;terhadap ART sangat penting (lihat&nbsp;<a href=\"http://spiritia.or.id/li/bacali.php?lino=405\" style=\"color: rgb(153, 0, 0);\">LI&nbsp;405</a>). Tes viral load dipakai untuk menentukan apakah ART bekerja sebagaimana mestinya. Bila viral load kita tidak turun, atau turun tetapi naik kembali, mungkin kita harus beralih ke kombinasi ARV lain.</p><h2 style=\"font-size: 1em; font-weight: bold; color: rgb(0, 100, 0); margin-top: 1em; padding-top: 1em; border-top: thin solid; font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" line-height:=\"\" normal;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Apa yang Selanjutnya?</h2><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Obat baru sedang ditelitikan dalam kelima golongan yang ada. Para peneliti juga berupaya mengembangkan golongan obat baru, misalnya obat yang menghambat langkah lain pada siklus hidup HIV, dan obat yang akan menguatkan ketahanan oleh kekebalan tubuh.</p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\"><br></p><p style=\"font-family: arial, \" trebuchet=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" padding-top:=\"\" 0px;=\"\" line-height:=\"\" 1.25em;=\"\" font-size:=\"\" 11pt;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">Sumber :&nbsp;http://spiritia.or.id/li/bacali.php?lino=403</p>','1472377095350-Puskesmas-Kota-Depok-Akan-Berlakukan-Terapi-ARV-Segera.jpg','1','2016-08-18 06:14:34',NULL),(161,1,2,'Memprihatinkan, Ratusan WNI Terinfeksi HIV/AIDS','Komisi Penanggulangan AIDS (KPA) Provinsi Gorontalo mengindikasikan ada 300 warga negara Indonesia (WNI) di Kabupaten Bone Bolango sudah teridentifikasi terinfeksi HIV/AIDS.','<p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><strong style=\"margin: 0px; padding: 0px;\">GORONTALO</strong>&nbsp;- Komisi Penanggulangan AIDS (KPA) Provinsi Gorontalo mengindikasikan ada 300 warga negara Indonesia (WNI) di Kabupaten Bone Bolango sudah teridentifikasi terinfeksi HIV/AIDS.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Kami menerima informasi dari KPA Provinsi Gorontalo, sebanyak 300 warga Bone Bolango terinfeksi HIV/AIDS dan tentunya ini memprihatinkan, sehingga perlu langkah pencegahan lebih optimal lagi,\" kata Wakil Bupati Bone Bolango, Kilat Wartabone saat membuka workshop cerdas cermat HIV/AIDS pada pelajar SMA, SMK, dan Madrasah Aliyah tingkat Kabupaten Bone Bolango di SMA Negeri 1 Kabila, Jumat (13/5/2016).<br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Banyaknya jumlah warga Bone Bolango yang terindikasi sudah terjangkit dan terinfeksi virus HIV/AIDS ini menjadi perhatian utama pihaknya.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Untuk itu, Kilat Wartabone yang juga Ketua Pelaksana Harian KPA Kabupaten Bone Bolango menawarkan kepada KPA Provinsi Gorontalo agar bisa bersama-sama dengan KPA Bone Bolango dan pemerintah daerah dengan melibatkan unsur instansi dan lembaga terkait lainnya, untuk berupaya melakukan pencegahan dan penanggulangan HIV/AIDS.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Yakni dengan melakukan sosialisasi penyadaran kepada seluruh masyarakat di semua lapisan agar menghindari hal-hal yang berpotensi adanya penyebaran virus tersebut.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Karena sesuai data yang dimiliki di KPA Bone Bolango, sebanyak 22 orang warga setempat yang terdeteksi dan sudah terinfeksi virus HIV/AIDS dan yang meninggal dunia sudah 12 orang.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Kilat menguraikan dengan data sebagaimana dilaporkan Sekretaris KPA Provinsi Gorontalo Dr Irwan, bahwa sekitar 300 orang warga Bone Bolango yang terindikasi terjangkit HIV/AIDS, bila dipetakan di 18 kecamatan di wilayah Kabupaten Bone Bolango, maka setiap kecamatan ada sekitar 20 orang yang mengidap HIV/AIDS.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Oleh karena itu, tinggal bagaimana upaya pencegahan dan penanggulangan pemangku kepentingan dengan melakukan penyadaran kepada masyarakat, tidak hanya kepada anak-anak didik atau pelajar.</p><p><br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Sosialisasi penyadaran kepada masyarakat akan bahaya HIV/AIDS ini jangan hanya kita fokuskan kepada anak-anak didik maupun pelajar. Karena di luar sana, banyak orang tua maupun orang dewasa yang terindikasi berpotensi terjangkiti HIV/AIDS, tapi kita tidak bisa deteksi,\" terangnya.</p><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><br></p></div><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Sumber :&nbsp;http://news.okezone.com/read/2016/05/13/340/1387388/memprihatinkan-ratusan-wni-terinfeksi-hiv-aids</p></div>','1472376735813-1650607_orig.jpg','1','2016-08-18 06:14:39',NULL),(171,1,2,'Ratusan Warga Biak Meninggal karena HIV/AIDS','Sebanyak 451 orang dari 1.670 penderita HIV/AIDS di Kabupaten Biak Numfor, Papua, tewas akibat penyakit menular mematikan tersebut.','<p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><strong style=\"margin: 0px; padding: 0px;\">BIAK</strong>&nbsp;- Sebanyak 451 orang dari 1.670 penderita HIV/AIDS di Kabupaten Biak Numfor, Papua, tewas akibat penyakit menular mematikan tersebut.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Kepala Sekretariat Komisi Penanggulangan AIDS (KPA), Selfi Rumbiak mengatakan, para penderita HIV/AIDS di Kabupaten Biak Numfor, rata-rata dialami kelompok usia produktif 20-29 tahun dengan 565 kasus.<br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Jajaran Pemkab Biak beserta KPA telah berkomitmen menangani penyakit HIV/AIDS dengan mencanangkan Biak bangkit melawan HIV/AIDS,\" kata dia, seperti dikutip dari Antara, Rabu (27/8/2016).</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Ia menambahkan, pencegahan penyakit menular HIV/AIDS tidak hanya menjadi tugas KPA, tetapi harus menjadi tanggungjawab semua elemen masyarakat Kabupaten Biak Numfor.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Sementara, tenaga operasional lapangan KPA Biak, Basri mengatakan, dari 1.670 kasus pengidap HIV/AIDS, penyebab paling dominan terjadi karena hubungan seksual yang prosentasenya mencapai 80 persen.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Dari seribuan kasus HIV/AIDS, jumlah pengidap tertinggi berjenis kelamin laki-laki sebanyak 891 kasus dan perempuan 727 kasus.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">KPA sebagai organisasi, menurut Basri, telah melakukan koordinasi dan singkronisasi program untuk mencegah penularan HIV/AIDS di Kabupaten Biak Numfor.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Salah satu program yang intens dilakukan KPA, menurut Basri, setiap waktu gencar menyosialisasikan tentang bahaya HIV/AIDS kepada masyarakat di berbagai kelompok warga.</p><p><br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">\"Ya meski dengan keterbatasan sarana prasarana tetapi kami tetap bekerja kemanusian untuk menyelematkan generasi muda Papua dari ancaman menyakit menular HIV/AIDS, saya harapkan keluarga harus berupaya mencegah penularan penyakit HIV/AIDS,\" harap Basri.</p><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><br></p></div><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Sumber :&nbsp;http://news.okezone.com/read/2016/07/27/340/1447721/ratusan-warga-biak-meninggal-karena-hiv-aids</p></div>','1472378203126-ratusan-warga-biak-meninggal-karena-hiv-aids-N9Ic6bSXR4.jpg','1','2016-08-18 06:13:39',NULL),(181,1,2,'Terjangkit HIV/AIDS, Napi Lapas Narkoba Meninggal Dunia','Dedi Mulyawan (34) seorang Narapidana (Napi) Lembaga Pemasyarakatan (Lapas) Narkoba Muara Beliti Kabupaten Musirawas, Sumatera Selatan diketahui meninggal dunia lantaran terjangkit virus Human Immunodeficiency Virus (HIV) dan mengidap Acquired Immune Deficiency Syndrome (AIDS).','<p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><strong style=\"margin: 0px; padding: 0px;\">MUSIRAWAS</strong>&nbsp;- Dedi Mulyawan (34) seorang Narapidana (Napi) Lembaga Pemasyarakatan (Lapas) Narkoba Muara Beliti Kabupaten Musirawas, Sumatera Selatan diketahui meninggal dunia lantaran terjangkit virus Human Immunodeficiency Virus (HIV) dan mengidap Acquired Immune Deficiency Syndrome (AIDS).</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Dedi yang merupakan warga Kelurahan Mesat Jaya, Kecamatan Lubuklinggau Timur II itu menghembuskan nafas terakhirnya Selasa 10 Mei 2016 malam sekira pukul 19.00 WIB di Rumah Sakit Umum Daerah (RSUD) Siti Aisyah Lubuklinggau. Kepala Lapas Narkotika Muara Beliti, Sri Yuwono membenarkan adanya warga binaan yang meninggal dunia akibat terinfeksi HIV.<br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">“Dedi menderita penyakit TBC dan terkena HIV/AIDS,” ujar Sri Yuwono.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Ditambahkan Sri Yuwono, Dedi sudah tiga kali mendapatkan penanganan medis secara intensif di rumah sakit di Kota Lubuklinggau.</p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">“Saat menghembuskan nafas terakhir Dedi ditemani keluarga. Sebab setiap masuk RS, keluarga selalu menemaninya,” tambah Sri.</p><p><br></p><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Jenazah Dedi sudah dibawa ke rumah duka untuk disemayamkan.</p><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\"><br></p></div><div><p style=\"margin-bottom: 15px; padding: 0px; display: inline-block; font-size: 17px; font-family: futura_book; color: rgb(51, 51, 51); line-height: 24.2857px;\">Sumber :&nbsp;http://news.okezone.com/read/2016/05/11/340/1385768/terjangkit-hiv-aids-napi-lapas-narkoba-meninggal-dunia</p></div>','1472377095350-Puskesmas-Kota-Depok-Akan-Berlakukan-Terapi-ARV-Segera.jpg','1','2016-08-18 07:13:39',NULL),(241,2,2,'Apa yang Tidak Boleh Dilakukan oleh ODHA','Gambar IlustrasiHIV atau AIDS adalah satu penyakit gangguan kekebalan tubuh yang paling ditakuti oleh banyak orang  sekarang ini. Seiring dengan semakin berkembangnya teknologi dan inovasi','<p style=\"text-align: center; \"><span style=\"font-family: serif;\">Gambar Ilustrasi</span></p><p><br></p><p>HIV atau AIDS adalah satu penyakit gangguan kekebalan tubuh yang paling ditakuti oleh banyak orang  sekarang ini. Seiring dengan semakin berkembangnya teknologi dan inovasi di bidang kesehatan maka telah diyakini bahwa orang yang hidup dengan AIDS dan HIV juga semakin bertambah. Orang yang sudah terjangkit penyakit ini tentu saja gerak hidupnya menjadi terhambat. Apa yang tidak boleh dilakukan oleh ODHA?</p><p>ODHA adalah kepanjangan dari Orang yang Hidup Dengan Aids atau HIV. Ada batasan tertentu bagi mereka yangs udah terkena penyakit ini untuk hidup bersama masyarakat. Mereka harus lebih bisa menjaga kesehatan dirinya dan menjaga kebersihan tubuh serta lingkungan dimana mereka tinggal jika tidak ingin penyakitnya bertambah buruk. Yang harus dilakukan pertama adalah memiliki dokter yang sangat ahli dan berpengalaman untuk menentukan apa saja yang tidak bisa dilakukan oleh ODHA. Yang pasti, ODHA tidak bisa memakan makanan mentah seperti daging mentah, ikan mentah atau telur mentah. Kenapa? Karena makanan yang mentah akan membuat tubuh bertambah sakit. Karena sistem kekebalan tubuh ODHA belum tentu bisa menahan risiko makanan mentah yang mungkin kurang bersih atau higienis. Jadi tidak aman untuk dikonsumsi.</p><p>Selain itu, apa yang tidak boleh dilakukan oleh ODHA adalah mengaktivasi sistem kekebalan. Jangan biarkan tubuh Anda terkena penyakit sekecil apapun, karena penyakit akan mengaktifkan sistem kekebalan tubuh Anda. Bila sudah terlanjur maka pengobatannya akan semakin sulit meskipun Anda hanya terkena penyakit flu biasa. Mereka yang sudah menjadi ODHA harus mengonsumsi obat khusus HIV. Jangan konsumsi hanya satu jenis obat HIV saja tetapi biasanya dokter memberi lebih dari tiga jenis obat khusus HIV yang bertujuan untuk menekan HIV yang ada di dalam tubuh. Terkadang satu pil mengandung lebih dari satu obat, seperti Combivir atau trizivir.</p><p>Jangan sembarangan menentukan jenis obat yang akan Anda konsumsi karena penanganan penyakit ini sangat membutuhkan bantuan dokter. Karena dokter tahu efek samping dan yang harus dihindari ketika mengonsumsi obat-obatan ini. jangan juga meminum obat dengan setengah-setengah karena melewati satu kali saja tidak meminum obat akibatnya akan sangat berbahaya. Yang terakhir, jangan berani mengonsumsi jenis obat tertentu untuk mengobati sekadar sakit kepala atau penyakit ringan tanpa tahu bahwa obat ini akan memberikan efek pada jenis obat HIV yang sedang Anda konsumsi.</p><p>Apa yang tidak boleh dilakukan oleh ODHA sungguh berat. Sebagai orang yang penuh rasa kemanusiaan sudah seharusnya kita mendukung dan memberikan support bagi mereka agar mereka juga bisa merasa hidup kembali walau mengidap penyakit yang mengerikan seperti AIDS dan HIV.</p>','1472619508346-Apa-yang-Tidak-Boleh-Dilakukan-oleh-ODHA.jpg','1','2016-08-31 04:58:31',NULL),(251,1,2,'Dua Penderita AIDS di Luwu Raya Meninggal Dunia','PALOPO - Wabah virus HIV dan penyakit AIDS di Luwu Raya kian meresahkan dan benar-benar harus diwaspadai oleh','<p><strong style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; line-height: 24px;\">PALOPO</strong><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"> - Wabah virus HIV dan penyakit AIDS di Luwu Raya kian meresahkan dan benar-benar harus diwaspadai oleh masyarakat dan pemerintah setempat. Dinas Kesehatan Kota Palopo mencatat ada dua orang penderita AIDS tahun ini yang meninggal dunia.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Pengelola Program Pencegahan dan Pengendalian HIV/AIDS Dinas Kesehatan Kota Palopo Sitti Asliha kepada </span><em style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; line-height: 24px;\">KORAN SINDO</em><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"> menyampaikan, data tersebut diperoleh khusus dari Rumah Sakit Umum Daerah (RSUD) Sawerigading Palopo.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">\"Tahun ini ada dua orang penderita AIDS yang meninggal dunia. Data ini merupakan laporan pihak RSUD Sawerigading di Rampoang. Alamat keduanya kami tidak bisa sampaikan, jelasnya dia berdomisili di Luwu Raya,\" ujarnya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">\"Data dari pengelola sebelumnya menyebutkan, dari tahun 2003 sampai Maret 2016 ada 79 penderita HIV dan AIDS yang berobat di Palopo asal Luwu Raya,\" tambahnya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Khusus tahun 2015, lanjut Sitti Asliha, ada sebanyak 18 orang penderita baru. Tahun 2016 per bulan Juni ada sebanyak tiga orang penderita baru virus HIV dan delapan orang penderita baru yang sudah positif AIDS. </span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">\"Kembali lagi saya sampaikan bahwa asal mereka dari Luwu Raya, bukan Kota Palopo saja, bisa saja dari Luwu, Luwu Utara, dan Luwu Timur,\" katanya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Sementara itu, Pengelola Program Komisi Penanggulangan AIDS (KPA) Kota Palopo Yohana Darma Yosita menyebutkan, temuan rumah sakit yang ada di Luwu Raya dari tahun 2006 hingga Juni 2016 menyebutkan ada sebanyak 129 kasus HIV dan AIDS di Luwu Raya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">\"Data tersebut merupakan temuan di seluruh rumah sakit baik milik pemerintah maupun rumah sakit swasta di Luwu Raya. Jumlah ini cukup tinggi. Kami berharap masyarakat bisa menghindari pola hidup yang berisiko terkena virus HIV yang mengakibatkan munculnya penyakit mematikan seperti AIDS,\" katanya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Menurut Yohana Darma Yosita, seseorang yang terjangkit virus HIV kadang tanpa gejala. \"Artinya dia masih terlihat sehat, belum ada penyakit. Kalau sudah masuk AIDS maka sudah masuk stadium 3 dengan ciri-ciri penderita mengalami macam-macam penyakit seperti TBC, penyakit kulit, sariawan, dan penyakit lainnya,\" katanya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Untuk itu, pihak KPA Kota Palopo mengimbau masyarakat rutin memeriksakan kesehatan, terutama mereka yang memiliki pola hidup kurang sehat yang rentan dengan penyakit seperti AIDS.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">\"Periksakan diri Anda secara berkala, dan paling utama adalah hindari pola hidup yang menyebabkan diri Anda rentan penyakit terutama AIDS, seperti gonta-ganti pasangan dan tidak menggunakan kondom, gunakan jarum suntik sekali pakai,\" katanya.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Kepala Dinas Kesehatan Kota Palopo Dr Ishak Iskandar juga mengingatkan bagi mereka yang sering menggunakan alat kecantikan di salon.</span><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">\"Tidak ada maksud untuk lain, ini hanya demi kebaikan bersama, penggunaan alat kecantikan yang terbuat dari besi, misalkan pisau atau silet alis, pisau, atau silet cukur agar berhati-hati dalam penggunaannya, karena selain berhubungam badan, virus HIV juga menular melalui perpindahan atau menyentuh dari penderita HIV.\"</span><br></p><p><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\"><br></span></p><p><span style=\"color: rgb(37, 37, 37); font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px;\">Sumber : http://daerah.sindonews.com/</span></p>','1472378009055-188-penderita-aids-di-sukabumi-meninggal-dunia-zFJOpz6KEJ.jpg','1','2016-09-05 04:03:04',NULL),(252,2,2,'Gejala HIV/ AIDS','HIV yaitu virus yang memperlemah kekebalan pada tubuh manusia. Orang yang terkena virus ini akan menjadi rentan terhadap infeksi oportunistik ataupun mudah terkena tumor. Meskipun penanganan','<div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\"><a href=\"http://www.kuminhat.com/2013/12/pengertian-gejala-dan-cara-pencegahan.html\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 153, 204); outline: none; transition: all 0.5s;\">HIV</a> yaitu virus yang memperlemah kekebalan pada tubuh manusia. Orang yang terkena virus ini akan menjadi rentan terhadap infeksi oportunistik ataupun mudah terkena tumor. Meskipun penanganan yang telah ada dapat memperlambat laju perkembangan virus, namun penyakit ini belum benar-benar bisa disembuhkan.</div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\"><br style=\"margin: 0px; padding: 0px;\">Tanda pertama penderita HIV biasanya akan mengalami demam selama 3 sampai 6 minggu tergantung daya tahan tubuh. Setelah kondisi membaik orang yang terinfeksi HIV akan tetap sehat dalam beberapa tahun dan secara perlahan kekebalan tubuhnya akan menurun karena serangan demam yang berulang.</div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\"><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; vertical-align: baseline;\">Sebelum seseorang bisa dikatakan terkena penyakit HIV/AIDS, Ia akan mengalami gejala-gejala sebagai berikut :</div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; vertical-align: baseline;\"><br style=\"margin: 0px; padding: 0px;\"></div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; vertical-align: baseline;\">1. Penderita akan mengalami demam tinggi yang berkepanjangan </div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; vertical-align: baseline;\">2. Penderita akan mengalami napas pendek, batuk, nyeri dada dan demam, Ia akan kehilangan nafsu makan, mual, dan muntah</div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; vertical-align: baseline;\">3. Diare kronis yang tidak dapat dijelaskan pada infeksi HIV dapat terjadi karena berbagai penyebab; antara lain infeksi bakteri dan parasit yang umum (seperti Salmonella, Shigella, Listeria,Kampilobakter, dan Escherichia coli), serta infeksi oportunistik yang tidak umum dan virus (seperti kriptosporidiosis, mikrosporidiosis, Mycobacterium avium complex, dan virus sitomegalo (CMV) yang merupakan penyebab kolitis).</div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; vertical-align: baseline;\">4. Batuk berekepanjangan<br style=\"margin: 0px; padding: 0px;\">5. Esofagitis adalah peradangan pada kerongkongan (esofagus), yaitu jalur makanan dari mulut ke lambung. Pada individu yang terinfeksi HIV, penyakit ini terjadi karena infeksi jamur (jamurkandidiasis) atau virus (herpes simpleks-1 atau virus sitomegalo). Ia pun dapat disebabkan oleh mikobakteria, meskipun kasusnya langka<br style=\"margin: 0px; padding: 0px;\">6. Pembengkakan kelenjar getah bening diseluruh tubuh (dibawah telinga, leher, ketiak, dan lipatan paha)<br style=\"margin: 0px; padding: 0px;\">7. Sakit kepala<br style=\"margin: 0px; padding: 0px;\">8. Sulit berkonsentrasi<br style=\"margin: 0px; padding: 0px;\">9. Respon anggota gerak melambat<br style=\"margin: 0px; padding: 0px;\">10. Sering nyeri dan kesemutan pada telapak tangan dan kaki<br style=\"margin: 0px; padding: 0px;\">11. Mengalami tensi darah rendah<br style=\"margin: 0px; padding: 0px;\">12. Terjadi serangan virus cacar air dan cacar api<br style=\"margin: 0px; padding: 0px;\">13. Infeksi jaringan kulit rambut<br style=\"margin: 0px; padding: 0px;\">14. Kulit kering dengan bercak-bercak.</div></div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\"><br></div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18.2px; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"font-weight: bold;\">Sumber </span>: <span style=\"font-style: italic; font-color:blue;\"><a href=\"http://kuminhat.com\" target=\"_blank\">http://www.kuminhat.com/</a></span></div>','1472377095350-Puskesmas-Kota-Depok-Akan-Berlakukan-Terapi-ARV-Segera.jpg','1','2016-09-05 04:12:38','http://www.kuminhat.com/'),(261,1,11,'PMI Menemukan Kantong Darah Terkontaminasi HIV','Merdeka.com - Kantor Unit Transfusi Darah (UTD) Palang Merah Indonesia (PMI) Cabang Kabupaten Madiun, Jawa Timur menemukan 15','<p><b style=\"font-family: arial; border: 0px none; font-size: 15px; margin: 0px; outline: none 0px; padding: 0px; color: rgb(0, 0, 0); line-height: 25px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;\">Merdeka.com - </b><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Kantor Unit Transfusi Darah (UTD) Palang Merah Indonesia (PMI) Cabang Kabupaten Madiun, Jawa Timur menemukan 15 kantong darah pendonor yang terkontaminasi virus HIV pada Januari-Agustus 2016. Keberadaan kantong darah yang terkontaminasi virus HIV tersebut diketahui melalui proses screening infeksi menular lewat tranfusi darah (IMLTD) yang dilakukan oleh petugas PMI setempat.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Kepala Bidang Pelayanan UTD PMI Kabupaten Madiun Dony Dwi Setyawan mengatakan, atas temuan itu pihaknya menggandeng Dinas Kesehatan setempat dan Komisi Penanggulangan HIV/AIDS Kabupaten Madiun untuk memberikan pendampingan terhadap 15 orang pendonor terinfeksi HIV tersebut. Menurut dia, sesuai hasil temuan, secara total dari bulan Januari-Agustus jumlah kantong darah pendonor yang reaktif penyakit menular berbahaya mencapai 119 kantong. Yakni meliputi reaktif penyakit hepatitis B, hepatitis C, sifilis, dan HIV.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Ia menyebutkan dari 119 kantong darah terkontaminasi tersebut, untuk yang reaktif penyakit hepatitis B mencapai 66 kantong, hepatitis C 14 kantong, sifilis 24 kantong, dan HIV sebanyak 15 kantong.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">\"Setiap bulan pasti ditemukan darah yang terpapar penyakit setelah melalui proses screening IMLTD,\" terang Dony seperti dilansir Antara, Kamis (8/9).</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Atas temuan itu, pihaknya memanggil pendonor yang terjangkit penyakit tersebut dan memberikan penjelasan. Untuk pengobatan bisa dilakukan di dokter maupun rumah sakit.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Selain pemanggilan, pihaknya juga melarang pendonor bersangkutan melakukan donor darah kembali. Untuk memudahkan pemantauan, pihaknya langsung memblokir nomor peserta para pendonor yang diketahui darahnya terpapar penyakit menular berbahaya tersebut.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">\"Sementara terhadap kantong darahnya yang terpapar tersebut akan dimusnahkan karena sangat berbahaya jika digunakan untuk pasien atau orang lain,\" katanya.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Ia menambahkan untuk menjaga keamanan stok darah, pihaknya telah memiliki pendonor tetap yang setiap harinya secara berkala melakukan donor darah di kantor PMI setempat. Jumlahnya mencapai 15 hingga 20 kantong darah setiap hari.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Selain itu, PMI Kabupaten Madiun juga memiliki program unggulan, yakni Desa Siaga. Program yang berjalan sejak tahun 2006 lalu itu telah menggandeng 145 pendonor tetap dari Kabupaten Madiun.</span><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><br style=\"font-family: arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 25px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Tiap tiga bulan sekali, PMI mendatangi desa-desa untuk mengadakan kegiatan donor darah. Kegiatan itu dilakukan bekerja sama dengan bidan desa, perangkat desa, dan ketua desa siaga di kelurahan setempat. Dengan upaya tersebut, pihaknya yakin stok darah di PMI setempat akan aman.</span><br></p><p><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\"><br></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 15px; line-height: 25px;\">Sumber : http://www.merdeka.com/peristiwa/pmi-temukan-kantong-darah-terkontaminasi-virus-hiv.html</span></p>','1473438609015-pmi-temukan-kantong-darah-terkontaminasi-virus-hiv.jpg','1','2016-09-09 16:30:09',NULL),(321,2,2,'Mitos HIV dan AIDS','        Banyak mitos tentang bagaimana cara seseorang dapat terkena HIV. Mari kita diskusikan hal tersebut','<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">        </span><span helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Banyak mitos tentang bagaimana cara seseorang dapat terkena HIV. Mari kita diskusikan hal tersebut untuk memastikan kenyataan tentang bagaiaman <b>HIV menular</b>.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"> </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-at