span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">HIV tidak dapat bertahan hidup dalam sebuah alat music, Meskipun alat music yang digunakan menggunakan mulut, tetap tidak akan menularkan HIV.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"> </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Kondom Bekas<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">HIV hanya dapat bertahan untuk waktu yang sanagt singkat saat diluar tubuh, meskipun kondom terdapat sperma dari orang yang terkena HIV positif, HIV tetap akan mati.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"> </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Berciuman<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Kecil kemungkinan bahwa HIV terdapat pada ludah seseorang yang terinfeksi HIV, maka dari itu HIV tidak dapat menular melalui ciuman. Hanya ada resiko jika pasangan yang memiliki sobekan luka yang besar dan gusi berdarah, kemudian darah keduanya bertukar.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"> </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Oral Seks<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Sama seperti ciuman, resiko HIV dari oral seks sangatlah kecil kecuali kita atau pasangan kita memiliki luka yang terbuka lebar pada daerah genital atau gusi berdarah atau luka dimulut. Selalu menggunakan kondom atau <i>dental dam</i> untuk menghilangkan resiko.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"> </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"> <b>Tato dan Tindik<o:p></o:p></b></span></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\">Hanya ada resiko jika jarum yang sudah digunakan oleh seorang yang professional pada tubuh seseorang yang terinfeksi dan tidak dibersihkan atau disterilkan sesudahnya.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:black;mso-themecolor:text1\"=\"\" style=\"font-size: 10pt;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, sans-serif; font-size: 13.3333px;\">Sumber : <a href=\"http://www.avert.org/hiv-transmission-prevention/myths\" target=\"_blank\">Avert.org</a> , <a href=\"https://www.mbatious.com/sites/default/files/ogimage/myth.jpg\" target=\"_blank\">mbatious.com</a></span></p><div><br></div>','1478774132781-myth.jpg','1','2016-11-10 10:35:34',NULL),(391,1,2,'Penderita HIV dengan Depresi Berisiko Kena Serangan Jantung','        Menurut sebuah penelitian terbitan JAMA Cardiology, lebih dari 26.000 penderita  Human Immunodeficiency Virus (HIV) yang juga  mengalami depresi sangat rentan untuk','<p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">        Menurut sebuah penelitian terbitan <em>JAMA Cardiology</em>, lebih dari 26.000 penderita  <em>Human Immunodeficiency Virus</em> (HIV) yang juga  mengalami depresi sangat rentan untuk terkena <a href=\"http://health.liputan6.com/read/2579538/kenali-tanda-tanda-serangan-jantung-di-usia-muda\" style=\"color: rgb(246, 118, 56);\">serangan jantung</a>.  </p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Munculnya terapi antiretroviral sangat efektif untuk meningkatkan kelangsungan hidup lebih lama pada penderita<a href=\"http://health.liputan6.com/read/2587649/donna-agnesia-galang-dana-untuk-anak-dengan-hivaids\" style=\"color: rgb(246, 118, 56);\"> HIV</a>, namun sekarang mereka mengalami peningkatan risiko penyakit kardiovaskular (CVD).</p><p><div style=\"text-align: justify;\"><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">        Peneliti dari Vanderbilt University School of Medicine, Nashville, Matthew S. Freiberg, M.D., M. Sc, melakukan penelitian yang mencakup 26.144 veteran yang terinfeksi HIV tanpa CVD, dari tahun 1998 sampai 2003. Mereka berpartisipasi dalam U.S. Department of Veterans Affairs Veterans Aging Cohort Study, dari bulan April 2003 sampai Desember 2009. Pada awal studi, 4.853 veteran (sekitar 19 persen), teridentifikasi dengan gangguan depresi mayor.Hal ini pun menyebabkan adanya kebutuhan mendesak untuk mengidentifikasi faktor risiko dan pencegahan penyakit kardiovaskular pada HIV. Walaupun rasa depresi sangat lazim terjadi pada orang dewasa yang terinfeksi HIV.</div></span></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">        Rata-rata usia yang mengalami gangguan tersebut adalah 47 tahun dan yang tidak mengalaminya adalah 48 tahun. Selama 5,8 tahun penelitian, 490 infark miokard akut (IMA, serangan jantung) terjadi. Setelah penyesuaian demografi pada faktor risiko <a href=\"http://health.liputan6.com/read/2579538/kenali-tanda-tanda-serangan-jantung-di-usia-muda\" style=\"color: rgb(246, 118, 56);\">penyakit kardiovaskular</a> dan HIV, para peneliti menemukan bahwa orang dewasa dengan HIV yang juga mengalami gangguan depresi, memiliki risiko 30 persen lebih besar mengalami serangan jantung, dibandingkan dengan orang dewasa HIV tanpa gangguan tersebut.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">        Namun risiko serangan jantung tersebut berkurang hingga 25 persen setelah penyesuaian lebih lanjut pada faktor lain, seperti infeksi hepatitis C, penyakit ginjal, alkohol, penyalahgunaan kokain, dan tingkat hemoglobin.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">“Temuan kami meningkatkan kemungkinan bahwa, mirip dengan populasi umum, MDD dapat secara independen terkait dengan insiden aterosklerosis CVD pada populasi yang terinfeksi HIV. Namun mengingat studi mengenai hal ini masih langka maka dibutuhkan studi epidemiologi dan mekanistik lebih lanjut di masa depan yang mencakup wanita dan non-VA populasi dengan HIV,” tulis para peneliti.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sumber : <a href=\"http://health.liputan6.com/read/2588817/penderita-hiv-dengan-depresi-berisiko-kena-serangan-jantung\" target=\"_blank\">Liputan6</a></p>','1478832120099-060503600_1465641414-single-broken-heart-800x400.jpg','1','2016-11-11 02:42:00',NULL),(401,1,2,'Kasus Baru HIV/AIDS di Indonesia Terus Meningkat','Penelitian baru yang dirilis International AIDS Conference di Durban, Afrika Selatan menemukan, laju infeksi HIV baru di Indonesia meningkat lebih cepat daripada negara-negara lain','<p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Penelitian baru yang dirilis <em>International <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\">AIDS</a> Conference </em>di Durban, Afrika Selatan menemukan, laju infeksi<a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\"> HIV</a> baru di Indonesia meningkat lebih cepat daripada negara-negara lain di Asia Tenggara.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><em>Healthdata</em> mencatat, antara 2005 dan 2015, kasus <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\">HIV</a> baru tumbuh rata-rata 3,2 persen per tahun di Indonesia. Sedangkan di Malaysia, Thailand, dan Vietnam mengalami penurunan.</p><p><div style=\"text-align: justify;\"><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">    Kombinasi jumlah infeksi baru yang tinggi dan cakupan ART rendah ini terbukti bersifat mematikan di Indonesia. <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56); background-color: rgb(255, 255, 255);\">HIV/AIDS</a>membunuh sebanyak 18.560 penduduk Indonesia pada 2015, meningkat sebanyak hampir enam kali lipat sejak tahun 2005. Walaupun jumlah orang yang hidup dengan HIV di Indonesia meningkat dari 146.560 ke 440.510 sepanjang periode waktu.Pada waktu yang sama, cakupan <em>antiretroviral therapy</em> (ART) di Indonesia hanya sebanyak 11,7 persen, yang berarti Indonesia adalah salah satu negara yang paling sedikit mendapat ART. Hanya ada sedikit negara yang memiliki cakupan ART lebih rendah, seperti Afghanistan, Pakistan, dan Somalia.</div></span></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">“Penyebaran ART di Indonesia masih belum merata dan seharusnya lebih diarahkan kepada daerah-daerah di mana yang telah teridentifikasi sebagai kantong dengan prevalensi <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> tinggi, seperti di wilayah Indonesia Timur,\" kata Dr. Soewarta Kosen dari Badan Penelitian Dan Pengembangan Kesehatan, Kementerian Kesehatan RI.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">            Menurut Soewarta, percepatan dari penyebaran ART harus diprioritaskan dan mencakup kelompok-kelompok rentan dan berisiko tinggi (homoseksual, transgender, IV Drug Users, pekerja seks dan lingkungan penjara). Di samping itu, komorbitas antara HIV dan Tuberkulosa, perlu sekali mendapat perhatian agar dapat dicegah, karena prevalensi Tuberkulosa sangat tinggi dan merupakan salah satu penyebab utama kematian.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Direktur London School of Hygiene and Tropical Medicine dan direktur eksekutif pendiri UNAIDS, Professor Peter Piot, turut berkomentar dalam penelitian ini. Dia mengatakan, studi ini menunjukkan, epidemi AIDS belum berakhir sama sekali, dan bahwa <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a>masih merupakan salah satu ancaman kesehatan masyarakat terbesar saat ini.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Jumlah tinggi yang terus bertambah sebanyak lebih dari dua juta infeksi baru menunjukkan kegagalan kolektif yang harus diatasi melalui upaya pencegahan yang intensif dan investasi dalam riset vaksin <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\">HIV</a> secara berkesinambungan,\" katanya.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Penelitian ini membahas mortalitas, prevalensi, dan insiden HIV antara tahun 1980 dan 2015, dan merupakan bagian dari Global Burden of Disease Study 2015 yang menampilkan perkiraan kesehatan masyarakat secara menyeluruh dalam hal penyakit, cedera, dan faktor-faktor risiko.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Tidak sebanding dengan penurunan infeksi baru yang secara keseluruhan melambat, jumlah orang yang hidup dengan<a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\"> HIV</a> di tingkat global meningkat secara signifikan, dan ini sebagian besar disebabkan oleh ekspansi terapi anti-retroviral.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Institute for Health Metrics and Evaluation (IHME) memperkirakan, ada sekitar 39 juta orang di seluruh dunia yang hidup dengan HIV pada 2015, dibandingkan dengan jumlah 28 juta pada tahun 2000.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Pada 2015, 41 persen orang yang hidup dengan HIV menggunakan ART, dibandingkan dengan 2 persen kurang dari jumlah tersebut di tahun 2000.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">“Kami membuat orang hidup lebih lama, dan jumlah ini seharusnya cukup memberi harapan bagi mereka yang menggunakan terapi anti retroviral,” kata Associate Professor IHME, Dr. Haidong Wang, penulis utama penelitian ini.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Namun, peningkatan semacam ini masih jauh dari sasaran ambisius 90-90-90 yang ditetapkan oleh masyarakat global untuk tahun 2020. Sasaran tersebut ditujukan bagi 90 persen orang yang hidup dengan HIV yang mengetahui status HIV mereka, 90 persen orang yang didiagnosis mengidap HIV yang mendapat terapi anti retroviral, dan 90 persen orang yang mendapat terapi anti retroviral yang mengalami penekanan virus.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">“Penelitian HIV oleh <em>Global Burden of Diseases</em> mengandung informasi kesehatan yang kritis untuk membantu membentuk dan mendukung pengambilan keputusan tingkat nasional dan global,” ujar Peter Hayward, editor <em>The Lancet HIV</em>.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Perkiraan ini juga merupakan kunci untuk memperkuat tanggung jawab dalam memastikan bahwa janji-janji yang dibuat oleh para politisi dan pembuat kebijakan sehubungan dengan target HIV tertentu akan diwujudkan.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Hasil penelitian IHME juga menekankan perlunya upaya yang lebih efektif untuk mencegah infeksi baru, serta pendanaan tambahan untuk semua upaya tersebut. Analisis ini menunjukkan, Development Assistance for Health (DAH) yang didedikasikan untuk HIV/AIDS paling cepat tumbuh antara tahun 2000 dan 2009, tapi pendanaannya tersendat sejak 2010.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Menurut Financing Global Health 2015, sebuah laporan yang diterbitkan tahun lalu oleh IHME, pendanaan tahunan global untuk HIV/AIDS mencapai puncaknya sejumlah AS$11,2 miliar pada 2013, tapi turun menjadi AS$10,8 miliar di 2015. Dengan melambatnya penurunan infeksi baru dan pendanaan untuk<a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\"> HIV/AIDS</a>, maka pencapaian sasaran yang ditetapkan oleh masyarakat global untuk mengakhiri AIDS sebelum tahun 2030 akan menjadi suatu tantangan.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Penelitian yang berasal dari kerjasama kolaboratif Global Burden of Disease ini diterbitkan dalam <em>The Lancet HIV</em>, yang melibatkan 74 negara yang mengalami peningkatan dalam jumlah standar usia infeksi <a href=\"http://health.liputan6.com/read/2542719/kampanye-bahaya-hiv-pangeran-harry-dan-coldplay-berbagi-panggung\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> baru antara 2005 dan 2015, termasuk Indonesia, Mesir, Pakistan, Kenya, Filipina, Kamboja, Meksiko, and Rusia.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sumber : <a href=\"http://health.liputan6.com/read/2557963/kasus-baru-hivaids-di-indonesia-terus-meningkat\" target=\"_blank\">Liputan6</a></p>','1478832459908-097532100_1429181095-HIV-AIDS.jpg','1','2016-11-11 02:47:39',NULL),(411,1,2,'HIV/AIDS Hantui Kaum Gay','        Komisi Penanggulangan AIDS Kota Depok mencatat pada periode 2013 sampai Desember 2015, sebanyak 548 orang terjangkit HIV/AIDS. Dari','<p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">        Komisi Penanggulangan AIDS Kota Depok mencatat pada periode 2013 sampai Desember 2015, sebanyak 548 orang terjangkit <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a>. Dari jumlah itu, 21,5 persen penularannya ada di kelompok Lelaki Seks dengan Lelaki (LSL). Sisanya, pasangan yang memiliki riwayat seks bebas.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Kepala Seksi Pengendalian dan Pemberantasan Penyakit Dinas Kesehatan Kota Depok, Agus Gojali mengatakan, tren penularan penyakit <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> di Depok telah bergeser.</p><p><div style=\"text-align: justify;\"><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">\"Secara Nasional penularan <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56); background-color: rgb(255, 255, 255);\">HIV/AIDS</a> tertinggi ada di kelompok Ibu Rumah Tangga (IRT). Namun, tidak terjadi di Kota Depok. Malahan paling banyak adalah kelompok LSL,\" kata Agus Ghazali, Rabu (2/11/2016).Pada rentang 1997- 2011, penderita <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"background-color: rgb(255, 255, 255); color: rgb(246, 118, 56);\">HIV/AIDS</a>banyak ditemukan pada kelompok pengguna jarum suntik atau Penasun. Seiring berjalannya waktu, penularannya merambah pada kelompok Lelaki Seks dengan Lelaki (LSL).</div></span></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Terpisah, Sekertaris II Komisi Penanggulangan <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> Kota Depok, Wimbo Asmoro menyebutkan sesuai pemetaan Tahun 2015 kemarin kelompok Lelaki Seks dengan Lelaki (LSL) di Kota Depok ada 2.030 orang. Tercatat, 73 LSL terjangkit <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a>.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">“Pemetaan kami lakukan ke titik-titik kumpul mereka yang ada di Kota Depok. Namun itu masih secara kasar, karena rata-rata LSL yang tinggal di Depok ngumpulnya enggak di Depok, malahan sebaliknya LSL di Bogor ngumpulnya di Depok,” ujar Wimbo.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Menurutnya, banyak faktor yang menyebabkan tinggi <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> di Kota Depok, utamanya persoalan ekonomi. Biasanya mereka ingin sekali gaya hidup mewah, namun tidak memiliki kemampuan mewujudkan impiannya tersebut, sehingga memilih cara menjual diri.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">“Ada kasus gini, sebelumnya kerja di Bali. Terus di pulau tersebut, dia berhubungan sesama jenis. Dia di taksir oleh pasangan sesama jenis, kebutuhannya terpenuhi. Pas pulang ke sini dia tertular HIV,” ungkap Wimbo Asmoro.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Selain itu, faktor tingginya <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> lainnya ialah ketidakpuasaan pasangan. “Udah enggak puas dengan pasangannya mereka cari pelampiasan dengan \'jajan\' diluar,” ujar Wimbo.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sumber : <a href=\"http://health.liputan6.com/read/2641782/hivaids-hantui-kaum-gay\" target=\"_blank\">Liputan6</a> , <a href=\"http://learnonline.canberra.edu.au/pluginfile.php/844029/mod_book/chapter/1788/groups.jpg\" target=\"_blank\">Group</a></p>','1478832838452-groups.jpg','1','2016-11-11 02:53:58',NULL),(421,1,2,'Menaker: RI Tercepat dalam Peningkatan Pengidap HIV/AIDS di Asia','Menteri Tenaga Kerja Hanif Dhakiri menyorot tajam peningkatan pengidap HIV/AIDS di Indonesia. Menurut dia, kehawatiran memuncak karena Indonesia jadi','<p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Menteri Tenaga Kerja <a href=\"http://news.liputan6.com/read/2283931/saat-menteri-hanif-dhakiri-terharu-dengar-kisah-gadis-desa\" title=\"Hanif Dhakiri\" style=\"color: rgb(246, 118, 56);\">Hanif Dhakiri</a> menyorot tajam peningkatan pengidap HIV/AIDS di Indonesia. Menurut dia, kehawatiran memuncak karena Indonesia jadi negara dengan peningkatan pengidap penyakit berbahaya tersebut tertinggi di Asia.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Jumlah pengidapnya terus meningkat secara signifikan,\" ucap Hanif dalam pidato pembukaan K3 Award di Gedung Bidakara, Jakarta, Rabu (17/5/2016).</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Indonesia merupakan negara dengan peningkatan kasus HIV/AIDS tercepat di wilayah Asia, data pengidap sudah pada kondisi mengkhawatirkan,\" sambung dia.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Bukan cuma itu, lebih mengkhawatirkan lagi Hanif menyebut usia pengidap HIV/AIDS ada di level umur <a href=\"http://news.liputan6.com/read/2374213/menaker-hanif-pp-pengupahan-kebijakan-terbaik-lindungi-pekerja\" title=\"produktif kerja\" style=\"color: rgb(246, 118, 56);\">produktif kerja</a>. \"HIV/AIDS menjadi penyakit yang menjadi masalah besar di dunia termasuk di Indonesia,\" papar Hanif.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Ini meningkat dari tahun ke tahun dan 85 persennya ada dalam usia produktif kerja,\" jelas menteri asal Partai Kebangkitan Bangsa (PKB) itu.<br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Dia menjelaskan, adanya fakta ini membuat dunia usaha <a href=\"http://news.liputan6.com/read/2449703/44-psk-pengidap-hivaids-di-tangerang-lepas-dari-pengawasan\" title=\"terdampak negatif\" style=\"color: rgb(246, 118, 56);\">terdampak negatif</a>. \"Dunia kerja akan menjadi sektor yang terdampak negatif mengingat usia kerja produktif adalah tulang punggung dunia usaha,\" tegas Hanif.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Meski demikian, dia menegaskan pemerintah tak akan tinggal diam. \"Penanggulangan HIV/AIDS merupakan bagian dari program K3 yang bertujuan untuk melindungi pekerja dari kecelakaan, penyakit dan gangguan kesehatan lain,\" pungkas Hanif.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sumber : <a href=\"http://news.liputan6.com/read/2510362/menaker-ri-tercepat-dalam-peningkatan-pengidap-hivaids-di-asia\" target=\"_blank\">Liputan6</a></p>','1478837336503-076121700_1458371815-menteri-tenagakerja.jpg','1','2016-11-11 04:08:56',NULL),(431,2,2,'Seks Bebas, Remaja Jalanan Rentan HIV/AIDS','            Seks bebas, penggunaan narkotika dan obat-obatan terlarang, dan minuman keras (miras) menjadi hal lumrah di sebagian anak','<p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">            Seks bebas, penggunaan narkotika dan obat-obatan terlarang, dan minuman keras (miras) menjadi hal lumrah di sebagian anak jalanan berusia remaja. Belum lagi penggunaan kondom yang tak ada membuat remaja jalanan rentan sekali tertular HIV AIDS.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Pusat Penelitian HIV AIDS (<em>HIV AIDS Research Center</em>) UNIKA Atma Jaya belum lama ini turun langsung ke jalan guna melakukan penelitian awal mengenai kekerasan seksual pada anak jalanan. Juga mencari tahu seberapa paham mereka mengenai HIV AIDS. Mereka mengaku tak tahu apa itu HIV, tapi mereka terbuka ketika diulik bagaimana perilaku seksualnya.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Menurut mereka semua itu bisa bikin mereka tenang, lebih pede, orang lebih maklum, dan goyangan lebih enak,\" kata salah seorang peneliti PPH Atma Jaya, Kekek Apriana di Jakarta, ditulis Selasa (17/5/2016).</p><p><div style=\"text-align: justify;\"><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Lokasi tempat mereka bercumbu juga beragam. Dari sekitar tongkrongan, empang, di bawah jembatan, hotel seharga Rp 25 ribu, dan mikrolet. \"Di mikrolet orang akan maklum kalau malam-malam mikrolet itu bergoyang,\" kata Kekek.Satu remaja secara terbuka mengatakan tidak apa-apa melakukan hubungan dengan pacar asal tidak terlalu sering.</div></span></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Remaja jalanan itu juga mengaku kerap mendapat perlakukan tidak menyenangkan dari sang kekasih, yang juga sesama anak jalanan. Pukulan dan tamparan biasa mereka terima. Pelaku selalu mengatakan tindakan semacam itu bentuk dari kasih sayang.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Kalau remaja jalanan perempuan pacaran sama yang lebih tua, mereka tidak boleh bekerja,\" kata Kekek.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Remaja jalanan juga ditanya mengenai pencegahan kehamilan. Dengan pengetahuan seadanya mereka jawab, dibuang di luar, menggunakan kondom, spiral, dan penggunaan pil KB secara rutin.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Penggunaan kondom dipahami tidak hanya sebagai pencegahan kehamilan tapi juga pencegahan penularan penyakit,\" kata Kekek.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sumber : <a href=\"http://health.liputan6.com/read/2508355/seks-bebas-remaja-jalanan-rentan-hivaids\" target=\"_blank\">Liputan6</a></p>','1478837921649-086099500_1463427552-depresive_teen.jpg','1','2016-11-11 04:18:41',NULL),(451,2,2,'25 Tahun Menderita HIV karena Ayahnya, Pria Ini Jadi Motivator','Seorang pria yang disuntik virus HIV saat bayi oleh ayahnya sendiri, telah berhasil melampaui perkiraan para dokter yang mengatakan','<div class=\"article-content-body__item-page \" data-page=\"1\" data-title=\"\" style=\"line-height: 23px;\"><div class=\"article-content-body__item-content\"><p style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px; text-align: justify;\">Seorang pria yang disuntik virus <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV</a> saat bayi oleh ayahnya sendiri, telah berhasil melampaui perkiraan para dokter yang mengatakan bahwa harapan hidupnya dulu sangat kecil.</p><p style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px; text-align: justify;\">Brryan Jackson, yang saat ini sudah berumur 25 tahun dari Missouri, disuntik <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV</a> oleh Brian Stewart, ayahnya, saat berusia 11 bulan. Stewart yang bekerja sebagai <em>tester </em>darah di laboratorium lokal menyuntikkan virus tersebut karena yakin kalau Jackson bukan anak kandungnya.</p><p><div style=\"text-align: justify;\"><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Bukan saja tak mengakui Jackson sebagai anak kandung, Stewart pun kerap melakukan kekerasan verbal dan fisik pada istrinya sekitar tahun 1992. Dia pun tak mau membayar tunjangan untuk anaknya.Padahal semula, Stewart begitu bahagia dengan kehadiran buah hatinya setelah menikahi kekasihnya yang juga bekerja sebagai tenaga medis. Namun entah mengapa, setelah pulang bertugas di Angkatan Laut Arab Saudi, karakter Stewart berubah.</div></span></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Setelah tak bertemu cukup lama, ibu Jackson menelepon Stewart dan mengatakan kalau anak mereka sakit dan dirawat. Sebagai seorang ayah, dia pun mendatangi anaknya yang terbaring. Sayangnya, bukan kasih sayang yang diberikan oleh Stewart, tapi musibah karena menyuntikkan HIV.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Anak Anda tidak akan hidup melampaui usia lima tahun,\" ujar Stewart kepada istrinya tentang kesehatan putranya tersebut.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sejak itu, kesehatan Jackson memburuk dengan cepat. Dia mulai menderita berbagai infeksi terkait HIV, meskipun Jackson belum resmi didiagnosis menderita virus tersebut hingga usia lima tahun. </p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Akhirnya, dokter pun menggambarkan kondisi Jackson sebagai <em>full-blown </em>AIDS, yaitu kondisi di mana sistem kekebalan tubuh sudah benar-benar lumpuh, dan penderita gampang terserang berbagai jenis penyakit. Jackson dinyatakan hanya bisa bertahan hidup lima tahun saja, kemudian dia disuruh pulang dengan banyak obat yang harus diminumnya.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Cobaan terhadap Jackson belum berhenti. Di usia tujuh tahun, Jackson mengalami demam yang sangat parah, organ hatinya bengkak, sehingga dia harus minum 23 jenis obat untuk <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV</a>-nya. Dokter pun menyakini Jackson akan bertahan hidup dalam hitungan jam saja.</p><p style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\"></span></p><div class=\"article-content-body__item-break\" style=\"color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px; position: relative; clear: both;\"><div class=\"article-content-body__item-break-index\" style=\"text-align: justify; position: absolute; top: -8px; left: 0px; right: 0px; margin: 0px auto; width: 150px; height: 1.3em; font-family: AcuminPro; line-height: 1.29; color: rgb(96, 96, 96);\"><br></div><hr class=\"article-content-body__item-break-line\" style=\"text-align: justify; margin-top: 40px; margin-bottom: 30px; border-top-color: rgb(231, 231, 231);\"></div></div></div><div class=\"article-content-body__item-page\" data-page=\"2\" data-title=\"Dijauhi dan dibully teman-teman\" style=\"font-size: 14px; line-height: 23px; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif;\"><h2 class=\"article-content-body__item-title\" style=\"text-align: justify; color: rgb(57, 57, 57); padding: 0px; font-size: 24px; margin-top: 40px; margin-bottom: 30px; font-family: AcuminPro; line-height: 1.29;\">Dijauhi dan dibully teman-teman</h2><div class=\"article-content-body__item-content\"><p style=\"text-align: justify;\">Nyata tidak. Jackson bersekolah seperti anak lainnya. Namun, dia harus menjalani hidupnya dengan <em>bully </em>dan dijauhi oleh teman-teman sekolahnya.</p><p style=\"text-align: justify;\">\"Saya merasa tidak ada tempat lagi di dunia ini untuk saya,\" ujarnya. Jackson pun menyalahkan ayahnya karena membuat hal-hal tersebut terjadi padanya.</p><p style=\"text-align: justify;\">\"Dia (ayahnya) tidak saja mencoba membunuh saya, dia mengubah hidup saya selamanya. Dia yang harusnya bertanggung jawab tentang <em>bullying </em>yang saya rasakan. Dia juga harus bertanggung jawab terhadap waktu bertahun-tahun yang saya rasakan di rumah sakit. Ia alasan mengapa saya harus begitu sadar tentang kesehatan saya dan apa pun yang saya lakukan,” ujarnya.</p><p style=\"text-align: justify;\">Kini, sang ayah tengah menjalani hukuman penjara seumur hidup sejak 1998. Permintaan pembebasan bersyarat ditolak hakim pada Juli 2016 lalu, dilansir laman <em>Independent</em>, Jumat (21/10/2016).</p><div class=\"article-content-body__item-break\" style=\"position: relative; clear: both;\"><hr class=\"article-content-body__item-break-line\" style=\"text-align: justify; margin-top: 40px; margin-bottom: 30px; border-top-color: rgb(231, 231, 231);\"></div></div></div><div class=\"article-content-body__item-page\" data-page=\"3\" data-title=\"Jadi motivator\" style=\"font-size: 14px; line-height: 23px; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif;\"><h2 class=\"article-content-body__item-title\" style=\"text-align: justify; color: rgb(57, 57, 57); padding: 0px; font-size: 24px; margin-top: 40px; margin-bottom: 30px; font-family: AcuminPro; line-height: 1.29;\">Jadi motivator</h2><div class=\"article-content-body__item-content\"><p style=\"text-align: justify;\">Setelah hampir dua dekade menjalani pengobatan, saat ini Jackson telah memiliki jumlah sel T yang tinggi, artinya status <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV</a>-nya kini tidak terdeteksi. Ia berharap suatu hari bisa menjadi seorang ayah, melalui proses pencucian sperma yang akan mencegah virusnya tertular pada anaknya.</p><p style=\"text-align: justify;\">Kisah hidupnya itu pun dapat menginspirasi banyak orang, Jackson pun menjadi motivator yang telah melakukan banyak perjalanan ke berbagai negara.</p><p style=\"text-align: justify; \">“Saya masih memiliki AIDS. Sekali didagnosis HIV, akan selalu didiagnosis <a href=\"http://health.liputan6.com/read/2605071/seberapa-efektif-kondom-dapat-mencegah-hivaids?source=search\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a>. Tetapi saya tetap merasa sehat, dan merasa bahwa diri saya adalah seorang \'atlet\' yang baik,” pungkasnya.</p><p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">Sumber : <a href=\"http://health.liputan6.com/read/2631916/25-tahun-menderita-hiv-karena-ayahnya-pria-ini-jadi-motivator\" target=\"_blank\">Liputan6</a></p></div></div>','1478917490411-061590000_1477026810-Brryan-Jackson.jpg','1','2016-11-12 02:24:50',NULL),(461,1,2,'Pengakuan PSK Penderita HIV/AIDS Terjaring Razia Ramadan','        Dua dari 13 pekerja seks komersial (PSK) yang terjaring razia oleh Satpol PP Kota Bekasi dinyatakan positif','<p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">        Dua dari 13 pekerja seks komersial (<a href=\"http://ramadan.liputan6.com/read/2542327/13-psk-di-bekasi-terjaring-razia-ramadan-dua-positif-hiv\" title=\"PSK\" style=\"color: rgb(246, 118, 56);\">PSK</a>) yang terjaring razia oleh Satpol PP Kota Bekasi dinyatakan positif terjangkit virus HIV/AIDS. Para PSK itu dinyatakan terjangkit HIV/AIDS setelah petugas mengambil sampel darahnya.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Salah satu PSK itu bernama Bela, warga Wisma Asri, Bekasi Utara, Kota <a href=\"http://ramadan.liputan6.com/read/2542327/13-psk-di-bekasi-terjaring-razia-ramadan-dua-positif-hiv\" title=\"Bekasi\" style=\"color: rgb(246, 118, 56);\">Bekasi</a>. Ironisnya, Bela baru beranjak 16 tahun dan nekat menjajakan diri.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Karena enggak punya duit buat jajan,\" kata Bela saat diamankan di kantor Satpol PP, Gedung Wali Kota Bekasi, Selasa 28 Juni 2016.Dia menjalani profesi sebagai PSK kurang lebih 6 bulan terakhir. Pasalnya, Bela berdalih tak memiliki peluang bekerja yang layak karena pendidikannya terputus setelah orangtuanya bercerai saat dia duduk di bangku kelas 6 SD.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Bela dan sejumlah PSK lainnya terjaring saat petugas Satpol PP Kota Bekasi melakukan penertiban terpadu pada Ramadan ini.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Mereka diciduk saat petugas menyisir Kawasan Terminal Bekasi, Jalan Ir Juanda. Saat itu, perempuan berambut cepak tersebut tengah mangkal di sebuah tempat yang bernama Gang Sempak alias GS.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Gang ini populer di kalangan para sopir angkutan umum di terminal Bekasi. Bela mengaku dapat melayani pria hidung belang sebanyak lima orang dalam semalam. Bahkan, dalam Ramadan ini.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Enggak lama, terjun begini baru lima atau enam bulanan. Biasanya mangkal di GS, Tambun, dan Pintu Air,\" ucap dia.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Ia menambahkan, tarif untuk melayani seorang tamu dipatok dengan harga Rp 300. Tarif itu dipotong komisi untuk Mami dan menyewa bilik seharga Rp 25 ribu hingga Rp 30 ribu.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">\"Ya, pasarannya Rp 300 ribu. Tapi ada buat Mami dan buat sewa kamar,\" ujar Bela yang ditangkap saat menunggu tamu di sebuah bilik semipermanen yang terbuat dari papan serta kayu.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sebelumnya, 12 PSK dan seorang waria terjaring razia dalam operasi penertiban terpadu yang dilakukan Satpol PP Kota Bekasi pada Selasa, 28 Juni 2016 malam.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Para PSK dan waria itu diamankan saat tengah mangkal dan melayani pelanggannya di sejumlah sudut jalanan kota. Razia ditujukan guna menjaga kesucian Ramadan.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sementara itu, Chaca, seorang waria yang berhasil ikut diangkut petugas, memilih diam dan menutup wajah saat wartawan hendak mewawancarainya.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Mereka juga telah menjalani tes <a href=\"http://ramadan.liputan6.com/read/2542327/13-psk-di-bekasi-terjaring-razia-ramadan-dua-positif-hiv\" title=\"HIV/AIDS\" style=\"color: rgb(246, 118, 56);\">HIV/AIDS</a> yang dilakukan Dinas Kesehatan (Dinkes) Kota Bekasi. Setelah didata dan diperiksa kesehatannya, para PSK dan seorang waria ini segera dikirim ke Panti Sosial Bina Insan Bangun Daya di Cipayung, Jakarta Timur.</p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\"><br></p><p style=\"text-align: justify; color: rgb(74, 74, 74); font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px;\">Sumber : <a href=\"http://ramadan.liputan6.com/read/2542405/pengakuan-psk-penderita-hivaids-terjaring-razia-ramadan\" target=\"_blank\">Liputan6</a></p>','1478918078089-pengakuan-dosa.jpg','1','2016-11-12 02:34:38',NULL),(471,1,2,'Inilah Terobosan Selama 8 Tahun Pengendalian HIV/AIDS di Indonesia','Jakarta, 5 Agustus 2014Selama 8 tahun terakhir, perkembangan terus dilakukan dalam upaya pengendalian HIV/AIDS di Indonesia, mulai','<p><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\">Jakarta, 5 Agustus 2014</span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Selama 8 tahun terakhir, perkembangan terus dilakukan dalam upaya pengendalian HIV/AIDS di Indonesia, mulai dari inovasi pencegahan penularan dari jarum suntik yang disebut Harm Reduction pada tahun 2006; pencegahan Penularan Melalui Transmisi Seksual (PMTS) mulai tahun 2010; penguatan Pencegahan Penularan dari Ibu ke Anak (PPIA) pda tahun 2011; pengembangan Layanan Komprehensif Berkesinambungan (LKB) di tingkat Puskesmas pada tahun 2012; hingga terobosan paling baru yang disebut Strategic use of ARV (SUFA) dimulai pada pertengahan tahun 2013.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Demikian pernyataan Menteri Kesehatan RI, dr. Nafsiah Mboi, Sp.A, MPH, pada Temu Media berjudul Apakah Indonesia sudah mencapai titik balik? di Kantor Kemenkes RI, Jakarta (5/8).</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Tahun 2006, epidemi HIV/AIDS di Indonesia paling banyak terdapat di kalangan pengguna narkoba suntik. Maka, penanganan utama saat itu adalah bagaimana mengurangi dampak buruk pada pengguna narkoba suntik (Penasun). Untuk itu, mulai awal tahun 2007 dilaksanakan pengurangan dampak buruk penularan melalui jarum suntik atau harm reduction. Program dilakukan melalui pemberian alat suntik steril, sebagai cara untuk memutus rantai penularan di antara Penasun. Pada saat sama, diselaraskan dengan pemberian layanan Methadone agar secara perlahan, para Penasun tersebut terbebas dari jeratan obat-obatan terlarang.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Ini merupakan suatu terobosan yang luar biasa. Karena inovasi tersebut mengubah cara pandang masyarakat yang semula kriminalisasi penasun menjadi upaya pencegahan penularan, ujar Menkes.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Senada dengan hal tersbeut, Menkes RI mendapatkan apresiasi besar di tingkat global pada kegiatan International Conference on AIDS 2014 di Australia, Senin (21/7). Peserta pertemuan mengaku terharu saat Menkes RI menyatakan sebuah kalimat, Do we want to kill them or save them? Because the easiest thing is to kill them.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Selanjutnya, tahun 2010 prevalensi penasun sudah mulai menurun secara bermakna, namun mulai muncul kasus HIV pada ibu rumah tangga sehingga mulai diintensifkan upaya pencegahan Penularan Melalui Transmisi Seksual (PMTS). Upaya tersebut diiintegrasikan dalam Strategi dan Rencana Aksi Nasional 2010-2014 (integrasi dalam RPJMN) dengan fokus pada populasi kunci di 141 Kab/Kota prioritas.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Sementara itu, tahun 2011, penularan kepada ibu rumah tangga dan mulai terjadi peningkatan  penularan dari Ibu positif HIV kepada bayi-bayi yang dilahirkan. Oleh karena itu, Kemenkes melakukan akselerasi peningkatan cakupan dan layanan Pencegahan Penularan dari Ibu ke Anak (PPIA), dengan tujuan utama untuk memutus rantai penularan dari orang tua ke bayinya. Hingga akhir tahun 2013, telah terdapat layanan PPIA di 91 RS dan di 23 Puskesmas.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Tahun 2012, mulai ditegaskan agar penanggulangan HIV/AIDS tidak boleh dipisahkan dari prioritas nasional pencapaian Millenium Development Goals ke-6 (MDGs-6). Sejak itulah, mulai dikembangkan Layanan Komprehensif Berkesinambungan (LKB) di tingkat Puskesmas. Dimana pelayanan HIV/AIDS mulai dari upaya pencegahan, tes HIV sedini mungkin, sampai kepada pengobatan dapat dilaksanakan di tingkat Puskesmas.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Akhirnya, terobosan paling anyar diperkenalkan pada pertengahan 2013, dinamakan Strategic use of ARV (SUFA). Merupakan kebijakan baru, yaitu setiap orang yang rentan atau berisiko, ditawarkan untuk melakukan tes. Dan bila hasilnya positif, akan langsung ditawari pemberian obat Antiretroviral (ARV).</div></span><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\"> </div></span><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Seperti kita ketahui, semakin dini penderita HIV diberikan retroviral, maka jumlah virus dalam darahnya menurun dan risiko penularan kepada orang lain juga berkurang, sehingga mutu hidupnya pun menjadi lebih baik, jelas Menkes.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Pada tahun 2012 dilakukan estimasi jumlah ODHA di Indonesia dan diperoleh hasil 591.823 orang dengan penyebaran di seluruh wilayah dan dapat dikatakan tidak ada satu provinsi pun yang terbebas dari HIV. Data yang dilaporkan Dinas Kesehatan Provinsi sampai dengan Juni 2014, jumlah kumulatif pengidap HIV sebanyak 143.078 orang dan penderita AIDS sebanyak 54.018 orang.</div></span><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><br></span></div><span style=\"color: rgb(0, 0, 0); font-family: ants-thin, Arial, \"Trebuchet MS\", Helvetica, sans-serif; font-size: 14px;\"><div style=\"text-align: justify;\">Terdapat dua epidemi HIV/AIDS di Indonesia, yaitu: 1) Epidemi terkonsentrasi pada kelompok tertentu yang disebut kelompok berisiko yakni pekerja seks dan pelanggannya, pengguna jarum suntik atau penasun, lelaki seks dengan lelaki (LSL), gay dan waria; serta 2) Generalized Epidemic atau epidemi yang sudah  tingkat epidemi HIV di sebagian besar provinsi di Indonesia pada tingkatan epidemi terkonsentrasi kecuali Tanah Papua (Papua dan Papua Barat) yang mempunyai status epidemi meluas rendah atau low generalized epidemic. Prevalensi HIV di Indonesia 0.4% sementara untuk Tanah Papua sebesar 2.3%. </div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Sumber : <a href=\"http://www.depkes.go.id/article/view/201408140002/inilah-terobosan-selama-8-tahun-pengendalian-hiv-aids-di-indonesia.html\" target=\"_blank\">Departemen Kesehatan Republik Indonesia</a></div></span></p>','1479093276074-20151123foto_aids_1.jpg','1','2016-11-14 03:14:36',NULL),(481,1,1,'Ilmuwan Ciptakan USB Khusus untuk Uji HIV','Liputan6.com, London - Pengembangan teknologi di bidang kesehatan kembali terbantu dengan perangkat ciptaan sekelompok peneliti asal Imperial','<p><b>Liputan6.com, London -</b> Pengembangan teknologi di bidang kesehatan kembali terbantu dengan perangkat ciptaan sekelompok <a href=\"http://tekno.liputan6.com/read/2593789/hebat-peneliti-indonesia-ini-ciptakan-batubara-ramah-lingkungan?source=search\">peneliti </a>asal Imperial College London. Mereka sedang mengembangkan stik USB yang dapat digunakan untuk mengukur seberapa banyak jumlah virus HIV di darah pasien.<br><br>Bekerja sama dengan perusahaan asal Amerika Serikat bernama DNA Electronics, tim peneliti berharap alat ini bisa menampilkan hasil pengujian secara tepat dan akurat.</p>\r\n<p>Meskipun masih dalam tahap awal pengembangan, pasien AIDS diharapkan dapat mengukur tingkat virus, sama mudahnya seperti pasien diabetes mengukur kadar gulanya.</p>\r\n<p>Teknologi ini menggunakan tetesan darah untuk mampu mendeteksi HIV yang ada di dalamnya. Setelah itu, perangkat ini akan menciptakan sinyal elektrik yang dapat dibaca komputer, laptop, dan perangkat genggam. </p>\n<div class=\"baca-juga\">\n<p class=\"baca-juga__header\">Baca Juga</p>\n<ul class=\"baca-juga__list\">\n<li><a href=\"http://tekno.liputan6.com/read/2647543/apple-resmi-jual-iphone-rekondisi\" target=\"_blank\" title=\"Apple Resmi Jual iPhone Rekondisi\">Apple Resmi Jual iPhone Rekondisi</a></li>\n<li><a href=\"http://tekno.liputan6.com/read/2648745/ini-3-smartphone-termurah-di-dunia\" target=\"_blank\" title=\"Ini 3 Smartphone Termurah di Dunia\">Ini 3 Smartphone Termurah di Dunia</a></li>\n<li><a href=\"http://tekno.liputan6.com/read/2648559/donald-trump-jadi-presiden-as-3-hal-ini-bakal-terjadi-di-apple\" target=\"_blank\" title=\"Donald Trump Jadi Presiden AS, 3 Hal Ini Bakal Terjadi di Apple?\">Donald Trump Jadi Presiden AS, 3 Hal Ini Bakal Terjadi di Apple?</a></li>\n</ul>\n</div> Cara ini membuat pengukuran jumlah virus lebih efektif, karena tes yang ada saat ini setidaknya membutuhkan waktu tiga hari untuk bisa mendapatkan hasilnya. Dengan demikian, perangkat ini dapat membantu lebih banyak pasien untuk memeriksa kadar virusnya sendiri. <br><br>\"Pemantauan merupakan hal yang krusial untuk menandakan keberhasilan pengobatan HIV. Sementara, saat ini pengujian kerap membutuhkan biaya dan peralatan kompleks, termasuk waktu pengujian yang cukup lama,\" ujar salah satu <a href=\"http://tekno.liputan6.com/read/2626505/bukan-gps-peneliti-temukan-teknologi-navigasi-baru-berbasis-wifi?source=search\">peneliti </a>dalam pengembangan ini, Graham Cooke, seperti dikutip dari <em>Mirror</em>, Minggu (13/11/2016).<br><br>Karenanya, tim <a href=\"http://tekno.liputan6.com/read/2602485/peneliti-ini-berhasil-kembangkan-pembasmi-alami-untuk-hama-kopi?source=search\">peneliti </a>mengembangkan perangkat anyar yang kini berukuran lebih ringkas sebesar chip USB, dari yang sebelumnya sebesar mesin foto kopi. Proses pengujian akan memanfaatkan <em>chip</em> ponsel dan setetes darah yang diletakkan di titik pada USB tersebut. <br><br>Berdasarkan beberapa kali uji coba, pengukuran menggunakan perangkat ini 95 persen akurat dengan sampel penelitian darah lebih dari 991. <br><br>Penelitian yang juga sudah diterbitkan di jurnal Scientific Reports ini menemukan waktu rata-rata yang diperlukan untuk membaca sebuah sampel adalah 20,8 menit.\r\n<p>(Dam/Isk)</p>','http://cdn0-a.production.liputan6.static6.com/medias/1403023/big/029401300_1478860478-HIV-USB-Image-3.jpg','1','2016-11-14 04:14:36',NULL),(491,1,2,'PEDOMAN PENCEGAHAN PENULARAN HIV DARI IBU KE ANAK ','Jumlah perempuan yang terinfeksi HIV dari tahun ke tahun semakin meningkat, seiring dengan meningkatnya jumlah laki-laki yang','<p style=\"text-align: justify; \">Jumlah perempuan yang terinfeksi HIV dari tahun ke tahun semakin meningkat, seiring dengan meningkatnya jumlah laki-laki yang melakukan hubungan seksual tidak aman, yang selanjutnya akan menularkan pada pasangan seksualnya.  Infeksi HIV pada ibu hamil dapat mengancam kehidupan ibu serta ibu dapat menularkan virus kepada bayinya. Lebih dari 90% kasus anak terinfeksi HIV, ditularkan melalui proses penularan dari ibu ke anak atau Mother To Child Hiv Transmission (MTCT). Virus HIV dapat ditularkan dari ibu yang terinfeksi HIV kepada anaknya selama kehamilan, saat persalinan dan saat menyusui.  Program Pencegahan Penularan HIV dari Ibu ke Anak (PPIA) telah terbukti sebagai intervensi yang sangat efektif untuk mencegah penularan HIV dari ibu ke anak. Di negara maju risiko anak tertular HIV dari ibu dapat ditekan hingga kurang dari 2% karena tersedianya intervensi PPIA dengan layanan optimal. Namun di negara berkembang atau negara miskin, dengan minimnya akses intervensi, risiko penularan masih berkisar antara 20% dan 50%. Salah satu alasan meningkatnya cakupan tes HIV dan terapi ARV pada ibu hamil adalah meningkatnya tes HIV dan konseling atas inisiasi petugas (Tes HIV atas Inisiatif Pemberi Pelayanan Kesehatan dan Konseling, TIPK/Prevention of Mother to Child HIV Transmission, PITC) di layanan antenatal dan persalinan, dan layanan kesehatan lainnya.  Di Indonesia, infeksi HIV merupakan salah satu masalah kesehatan utama dan salah satu penyakit menular yang dapat mempengaruhi kematian ibu dan anak. Human Immunodeficiency Virus (HIV) telah ada di Indonesia sejak kasus pertama ditemukan tahun 1987. Sampai tahun 2012 kasus HIV dan AIDS telah dilaporkan oleh 341 dari 497 kabupaten/kota di 33 provinsi. Kementerian Kesehatan memperkirakan, pada tahun 2016 Indonesia akan </p><p style=\"text-align: justify; \">mempunyai hampir dua kali jumlah orang yang hidup dengan HIV dan AIDS dewasa dan anak (812.798 orang) dibandingkan pada tahun 2008 (411.543 orang), bila upaya penanggulangan HIV dan AIDS yang dilaksanakan tidak adekuat sampai kurun waktu tersebut (Laporan Pemodelan Matematika epidemi HIV di Indonesia, Kemkes, 2012). </p><p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">Lampira Sumber, download link : </p><p style=\"text-align: justify; \">http://pppl.depkes.go.id/_asset/_regulasi/94_PMK%20No.%2051%20ttg%20Pencegahan%20Penularan%20HIV%20Ibu%20ke%20Anak.pdf</p>','1479194624037-pedomanku.jpg','1','2016-11-15 07:23:44',NULL),(511,1,1,'\'Iblis\' Pelaku Ritual Seks Penyebar HIV Segera Diadili di Malawi','Liputan6.com, Malawi Eric Aniva, seorang pria asal Malawi, diperkirakan akan segera diadili pada pekan ini. Pria tersebut','<p><b>Liputan6.com, Malawi</b> Eric Aniva, seorang pria asal <a href=\"http://global.liputan6.com/read/2562088/dapat-uang-dari-ritual-seks-dengan-anak-anak-aniva-ditangkap\" title=\"Malawi\">Malawi</a>, diperkirakan akan segera diadili pada pekan ini. Pria tersebut mengaku telah melakukan hubungan badan dengan ratusan wanita sebagai bagian dari <a href=\"http://global.liputan6.com/read/2562088/dapat-uang-dari-ritual-seks-dengan-anak-anak-aniva-ditangkap\" title=\"ritual pembersihan.\">ritual pembersihan.</a></p>\r\n<p>Aniva telah ditangkap pada Juli lalu. Penangkapan berlangsung usai dia melakukan hubungan badan dengan remaja 12 tahun yang diduga dilakukan secara tak aman.</p>\r\n<p>Bukan hanya itu, Aniva pun sampai sekarang masih bungkam soal statusnya yang mengidap virus HIV.</p>\r\n<p>Penangkapan terhadap Aniva merupakan perintah langsung Presiden Malawi, Peter Mutharika. Ia mengeluarkan kebijakan tersebut setelah, Aniva mengeluarkan pengakuan mengejutkan bahwa dirinya terus melakukan hubungan badan tak peduli ada penyakit yang hinggap.</p>\r\n<p>Mendengar pengakuan <a href=\"http://global.liputan6.com/read/2558641/kisah-pria-yang-dibayar-untuk-ritual-seksual-dengan-perawan\" title=\"Aniva\">Aniva</a>, beberapa kelompok masyarakat dan agama di Malawi naik pitam. Mereka mengecam apa yang telah diperbuat pria tersebut.</p>\r\n<p>\"HIV adalah pembunuh. Bagaimana bisa orang yang mempunyai status ini terus melakukan tindakan tersebut, pria itu setan, rakus dan egois,\" sebut pendeta Paul Mzimu seperti dikutip dari <em>BBC</em>.</p>\r\n<p></p>\n<div class=\"baca-juga\">\n<p class=\"baca-juga__header\">Baca Juga</p>\n<ul class=\"baca-juga__list\">\n<li><a href=\"http://global.liputan6.com/read/2562088/dapat-uang-dari-ritual-seks-dengan-anak-anak-aniva-ditangkap\" target=\"_blank\" title=\"Dapat Uang dari \'Ritual Seks\' dengan Anak-anak, Aniva Ditangkap\">Dapat Uang dari \'Ritual Seks\' dengan Anak-anak, Aniva Ditangkap</a></li>\n<li><a href=\"http://global.liputan6.com/read/2558641/kisah-pria-yang-dibayar-untuk-ritual-seksual-dengan-perawan\" target=\"_blank\" title=\"Kisah Pria yang Dibayar untuk \'Ritual Seksual\' dengan Perawan\">Kisah Pria yang Dibayar untuk \'Ritual Seksual\' dengan Perawan</a></li>\n<li><a href=\"http://global.liputan6.com/read/685080/beri-makan-rakyat-jelata-malawi-jual-pesawat-kepresidenan\" target=\"_blank\" title=\"Beri Makan Rakyat Jelata, Malawi Jual Pesawat Kepresidenan\">Beri Makan Rakyat Jelata, Malawi Jual Pesawat Kepresidenan</a></li>\n</ul>\n</div>\r\n<p>Bukan cuma Mzimu, kemarahan juga diperlihatkan seorang ibu asal Malawi. Perempuan bernama Memory Lakson tak habis pikir dengan pemikiran Aniva.</p>\r\n<p>\"Ia pengidap HIV positif dan ia memberikan virus ini ke perempuan tak berdosa,\" ucap Lakson.</p>\r\n<p>Aniva, di Malawi sudah lama dikenal dengan julukan \'hyena. Dia kerap melakukan hubungan seksual dengan anak-anak, janda, atau perempuan menikah yang tak kunjung hamil. Uniknya, ia mendapat bayaran untuk itu.</p>\r\n<p>Di sebuah desa terpencil di daratan Afrika itu, ada sebuah tradisi yang mewajibkan remaja putri untuk melakukan hubungan seksual dengan seorang pria bayaran, setelah mengalami menstruasi pertama.</p>\r\n<p>Bahkan ada yang baru berusia 12 tahun saat melakukan \'ritual pembersihan\' yang diyakini sebagai tolak bala itu.</p>\r\n<p>Tak hanya tradisi itu yang mengerikan bagi para gadis muda -- yang tak kuasa menolak karena takut mendatangkan malapetaka bagi keluarga atau desa.</p>\r\n<p><a href=\"http://global.liputan6.com/read/685080/beri-makan-rakyat-jelata-malawi-jual-pesawat-kepresidenan\" title=\"Aniva\">Aniva</a> mengaku pernah berhubungan seksual dengan setidaknya 104 perempuan -- ia lupa jumlah persisnya. \"Kebanyakan adalah remaja, siswi sekolah,\" kata dia kepada BBC.</p>\r\n<p>\"Beberapa remaja itu masih berusia 12 atau 13 tahun, tapi saya lebih menyenangi yang lebih matang. Semua wanita itu menikmati peran saya sebagai hyena.\"</p>\r\n<p>Lelaki itu sesumbar bahwa mereka yang pernah berhubungan seksual dengannya, membanggakan \'keperkasaannya\'.</p>\r\n<p>Menurut para penjaga tradisi, seorang hyena dipilih karena moral yang baik sehingga tidak bisa terinfeksi <a href=\"http://news.liputan6.com/read/255864/rumor-jual-beli-cpns-resahkan-peserta-tes\" title=\"HIV/AIDS\">HIV/AIDS</a>. Ternyata, anggapan mereka keliru belaka.</p>','http://cdn1-a.production.liputan6.static6.com/medias/1295171/big/060743100_1469165070-_4__90455794_aniva-plus-family.jpg','1','2016-11-13 07:23:44',NULL);

