insert  into `sahabat_odha`(`id_sahabatodha`,`id_user`,`komunitas`,`about_sahabatodha`) values (51,331,'Remaja Peduli HIV/ AIDS','Saya, Michael Hudson. Remaja aktif yang peduli terhadap HIV/ AIDS. \r\nSaya dan teman teman selalu mengadakan penyuluhan untuk masyarakat. \r\nMenjadi seseorang yang aktif dalam komunitas yang positif membuat saya tumbuh dan senantiasa belajar untuk menjadi lebih dewasa.\r '),(61,661,'Remaja Peduli HIV/ AIDS','Saya Juliana Indriana asal dari Ciumbuleuit, Bandung.\r\nSaya adalah seorang perawat di salah satu rumah sakit di kota Bandung.\r\nSaya memiliki hobby untuk berbagi informasi kepada sesama terutam terkait kesehatan.\r\nTergabung dalam komunitas Remaja Peduli HIV/ AIDS sejak tahun 2014 hingga saat ini.\r\nDengan berbagi saya dapat mengamalkan ilmu pengetahuan yang saya miliki. Semoga Saya dapat membantu rekan-rekan semua yang membutuhkan.\r\n\r\nSalam hangat,\r\n\r\n\r\nJuliana Indriana'),(71,231,'Peduli AIDS BAndung','Selalu berpikir positif dan senantiasa berbagi pengetahuan dalam kebaikan untuk sesama.\r\nSaya Ramdhan Rizki siap membantu rekan-rekan yang ingin berkonsultasi mengenai HIV/ AIDS.\r\nJangan sungkan, jangan ragu. Mari kita berbagi dalam kebaikan.\r\n'),(171,32,'Peduli AIDS Bandung','Halo, saya Ramdhan. Saya selalu ingin berbagi kepada sesama.');

UNLOCK TABLES;

/*Table structure for table `sticker` */

DROP TABLE IF EXISTS `sticker`;

CREATE TABLE `sticker` (
  `id_sticker` int(11) NOT NULL AUTO_INCREMENT,
  `id_picsticker` int(11) DEFAULT NULL,
  `id_pengirim` int(11) DEFAULT NULL,
  `message` varchar(80) NOT NULL,
  PRIMARY KEY (`id_sticker`),
  KEY `id_picsticker` (`id_picsticker`),
  KEY `id_pengirim` (`id_pengirim`),
  CONSTRAINT `sticker_ibfk_1` FOREIGN KEY (`id_picsticker`) REFERENCES `pic_sticker` (`id_pic`) ON UPDATE CASCADE,
  CONSTRAINT `sticker_ibfk_2` FOREIGN KEY (`id_pengirim`) REFERENCES `user` (`id_user`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=392 DEFAULT CHARSET=utf8;

